(8024, 117, 'Buste en pâte à sel', 'Je vends ma s&eacute;rie de 3 magnifiques bustes en p&acirc;te &agrave; sel fait maison.&nbsp;Suite &agrave; un accident de voiture, je me suis dis qu''il fallait que je fasse quelque chose de mes mains afin de laisser une trace sur notre plan&egrave;te. &nbsp;C''est dans la p&acirc;te &agrave; sel que je me suis trouv&eacute;. Cet mati&egrave;re noble &agrave; permis de laisser aller ma folie cr&eacute;atrice.&nbsp;En 1 an, ce n''est pas moins de 3 bustes de femmes que mes mains cr&eacute;&eacute;ront. &nbsp;<br />Je dois m''en s&eacute;parer &agrave; 10&euro; pi&egrave;ce. Vite vite, c''est de l''art!', 12, 30, '2013-12-18 15:47:57', 'upload/8024/53538993.jpg;upload/8024/91816019-o.jpg;upload/8024/Premiere-patisserie-sexy.jpg;', 'off', 'off', 'validee', 'off', 'off'),
