(8056, 132, 'OFFRE DE PRÊT ENTRE PARTICULIER', '<span>Bonjour,</span><br /><span>Je mets &agrave; votre disposition un pr&ecirc;t &agrave; partir de 5000&euro; a 950.000&euro; &agrave; des</span><br /><span>conditions tr&egrave;s simple</span><br /><span>&agrave; toutes personnes pouvant rembourser. Je fais aussi des</span><br /><span>investissements et des pr&ecirc;ts entre particulier de toutes sortes .</span><br /><span>J&rsquo;offre des cr&eacute;dits &agrave; court, moyen et long terme en collaboration avec</span><br /><span>mon avocat et une dur&eacute;e de remboursement abordable.</span><br /><span>Nous ignorons de vos usages et nos transferts sont assur&eacute;s par une</span><br /><span>banque pour la s&eacute;curit&eacute; de la transaction.</span><br /><span>Pour toutes vos demandes faites propositions par rapport aux taux et</span><br /><span>aux &eacute;chelonnements de paiements et je serai &agrave; votre aide.</span><br /><span>Enfin pour plus de compr&eacute;hension veuillez me joindre pas e-mail :</span><br /><a href="mailto:jovite.fauvir@hotmail.fr">f</a>idellemaire@hotmail.fr<br /><span>N.B : Je r&eacute;p&egrave;te, pas s&eacute;rieux .</span>', 31, 80, '2014-05-21 18:16:35', 'upload/8056/52af6a0ad49b6.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8057, 133, 'Profitez d''un prêt très attractif pour f', 'Vous avez un probl&egrave;me financier et toutes vos tentatives de reprise en main tombent &agrave; l''eau. Vous r&ecirc;vez de poss&eacute;der votre propre maison, mais on vous &agrave; refus&eacute; un pr&ecirc;t hypoth&eacute;caire &agrave; cause d''un cr&eacute;dit insuffisant.Je pr&eacute;sente &agrave; votre demande des pr&ecirc;teurs qui sont dispos&eacute;s &agrave; r&eacute;&eacute;valuer votre situation financi&egrave;re. Vous pouvez b&eacute;n&eacute;ficier des pr&ecirc;ts allant de 3000 &agrave; 100.000.000&euro;. Le taux d''int&eacute;r&ecirc;t est de 2%.', 31, 10, '2014-05-22 11:08:13', 'upload/8057/t-l-chargement.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8058, 134, 'Offre de pret rapide et urgente', 'Bonjour Madame / Monsieur<br /><br />Je lance un appel &agrave; toutes les personnes qui ont besoin de financement pour leur exprimer que j''offre de l''argent de 1000&euro; - 350.000.000&euro; cr&eacute;dible &agrave; toute personne capable de rembourser avec int&eacute;r&ecirc;t au taux de 3% par an et les p&eacute;riodes allant de 1 &agrave; 35 ans, selon de la quantit&eacute; requise. Je le fais dans les domaines suivants :<br /><br />- Pr&ecirc;t financi&egrave;re<br />- Hypoth&egrave;que<br />- Investissement de pr&ecirc;t<br />- Pr&ecirc;t automobile<br />- Consolidation de la dette<br />- Rachat de cr&eacute;dit<br />- Pr&ecirc;t personnel<br />- Vous &ecirc;tes dans l''archive<br /><br />Vous &ecirc;tes fich&eacute;s, interdits bancaires et vous n''avez pas la faveur des banques ou mieux vous avez un projet et besoin de financement, un mauvais dossier de cr&eacute;dit ou <br />Besoin d''argent pour payer des factures, fonds &agrave; investir sur les entreprises. Nous sommes en mesure de satisfaire nos clients dans les 48 heures suivant la r&eacute;ception de votre demande de cr&eacute;dit bien formul&eacute;. Si vous avez vraiment besoin d''argent pour faire ce pr&ecirc;t en bon &eacute;tat Veuillez me contacter t&ocirc;t aujourd''hui pour obtenir votre pr&ecirc;t dans les 48H &agrave; suivre.<br /><br />E-mail :&nbsp;&nbsp;&nbsp; auriane-dalmas@outlook.fr<br /><br />PS : mais pas s&eacute;rieuse s''abstenir. <br />Donc, je suis impatient de vos demandes par mail', 31, 10, '2014-05-22 15:02:51', '', 'off', 'off', 'validee', 'off', 'on'),
(8059, 135, 'offre de prêt avec une fiabilité inconte', 'Ce message s''adresse &agrave; tout ceux qui sont dans un besoin de pr&ecirc;t <br /> urgent et surtout s&eacute;rieux de demande de pr&ecirc;t : <br /> Vous avez besoin de faire un pr&ecirc;t, veuillez noter les domaines dans <br /> lesquels je peux vous aider : <br /> * Financement <br /> * Pr&ecirc;ts immobiliers <br /> * Pr&ecirc;ts &agrave; l''investissement <br /> * Pr&ecirc;t automobile <br /> * Dette de consolidation <br /> * Marge de cr&eacute;dit <br /> * Deuxi&egrave;me hypoth&egrave;ques <br /> * Rachat de cr&eacute;dit <br /> * Pr&ecirc;ts personnels <br /> Particulier france, canada, Belgique, Portugais, Italien, Fran&ccedil;ais , dannois et <br /> n''importe ou dans le monde entier nous mettons &agrave; votre disposition des <br /> pr&ecirc;t entre particulier &agrave; <br /> partir de 5000&euro; a 5. 700. 000&euro; &agrave; des conditions tr&egrave;s simple nous faisons aussi <br /> des investissements et des pr&ecirc;ts entre particulier de toutes sortes s <br /> offrons des cr&eacute;dits &agrave; court, moyen et long terme. Nous ignorons de vos <br /> usages et nos transferts sont assur&eacute;s par une banque pour la s&eacute;curit&eacute; de la <br /> transaction &agrave; toute personne capable de le rembourser avec int&eacute;ret au taux <br /> de 2% pour toute personne int&eacute;resser m''&eacute;crire <br /> En effet, j''ai d&eacute;cid&eacute; de faire cette activit&eacute; afin de permettre &agrave; <br /> toute personne dans le besoin de b&eacute;n&eacute;ficier de pr&ecirc;t allant de 5000&euro; a <br /> 5. 700. 000&euro; sous une dur&eacute;e de 5 &agrave; 40 ans selon le montant demand&eacute; avec <br /> un taux d&rsquo;int&eacute;r&ecirc;t annuel fixe tr&egrave;s int&eacute;ressant de 2 % pour tous les <br /> montants demand&eacute; r tous ceux qui souhaitent faire face aux <br /> probl&egrave;mes financiers actuels, je vous laisse ci dessous les contacts <br /> afin d&rsquo;obtenir plus d&rsquo;informations sur les conditions pour l&rsquo;obtention <br /> de pr&ecirc;t.', 31, 10, '2014-05-23 21:49:03', 'upload/8059/images-1-.jpg;', 'off', 'off', 'validee', 'off', 'on'),
(8060, 136, 'Vous avez besoin d''argent rapidement ? ', '<p><br />Bonjour</p><br />\r\n<p>Vous &ecirc;tes particulier, honn&ecirc;te et de bonne moralit&eacute;, vous disposez<br />d''un revenu pouvant vous permettre de Subvenir &agrave; vos mensualit&eacute;s.Je <br />mets &agrave; votre disposition un pr&ecirc;t &agrave; partir de 5000 &euro; &agrave; 5.000.000 &euro; avec <br />des conditions tr&egrave;s rentable &agrave; un taux d&rsquo;int&eacute;r&ecirc;t de 2%. Je ne fais pas <br />de l''usure sur pr&ecirc;t alors si vous &ecirc;tes int&eacute;ress&eacute; obtenez en moins de <br />72 heures la somme demand&eacute;e sur votre compte et tous vos probl&egrave;mes<br />seront r&eacute;solus .Vous pouvez me contacter directement par</p><br />\r\n<p>Mail : bernardnavarro1964@gmail.com</p><br />\r\n<p>Merci de me contacter</p><br />\r\n<p>Meilleur salutation</p><br />\r\n<em></em>', 31, 0, '2014-05-26 20:27:36', 'upload/8060/images.jpg;upload/8060/images-2-.jpg;', 'off', 'off', 'validee', 'off', 'on'),
(8061, 1, 'repare ordinateur à domicile', 'Professionnel r&eacute;pare tout ordinateur (Pc, Mac) &agrave; domicile.<br />R&eacute;installation des syst&egrave;me d''explottaion (windows, linux, mac)', 9, 50, '2014-05-27 16:18:11', '', 'off', 'off', 'validee', 'off', 'on'),
(8062, 137, 'Octroi de prêt entre particulier honnête', 'Bonsoir Mme et Mr<br />Moi je suis Mr Nicolas DUPONT. Je suis de nationalit&eacute; fran&ccedil;aise, ma capacit&eacute; de pr&ecirc;ter va jusqu&rsquo;&agrave; 1.000 000 &euro; par particulier. Vu les nombreuses arnaques qui existe aujourd&rsquo;hui dans le pr&ecirc;t entre particulier, je vous informe que beaucoup de pr&eacute;cautions ont &eacute;t&eacute; prise afin d&rsquo;assurer et garantie les personnes qui font les demandes de pr&ecirc;t.Mon taux d&rsquo;int&eacute;r&ecirc;t est unique et il est non n&eacute;gociable, fix&eacute; &agrave; 2% sur la valeur total demand&eacute;. J&rsquo;aimerais aussi vous demander de faire tr&egrave;s attention aux offres venant d&rsquo;Afrique (C&ocirc;te d&rsquo;Ivoire, B&eacute;nin et autres&hellip;), car presque toutes les personnes avec qui j&rsquo;entre en contact ont d&eacute;j&agrave; &eacute;t&eacute; victime d&rsquo;arnaque.Ces arnaques ont tellement pris de l&rsquo;ampleur &agrave; tel point que m&ecirc;me les cha&icirc;nes de t&eacute;l&eacute;vision en parlent (M6, et autre cha&icirc;ne d&rsquo;Afrique)Mon offre est s&eacute;rieuse, vous pourriez vous en rendre compte &agrave; travers la proc&eacute;dure qui est la proc&eacute;dure l&eacute;gale d&rsquo;octroi de pr&ecirc;t entre particulier.De gr&acirc;ce j&rsquo;aimerais &ecirc;tre contact&eacute; par des personnes s&eacute;rieuses, &eacute;tant en mesure de rembourser les pr&ecirc;ts. Les remboursements d&eacute;butent 3 mois apr&egrave;s que les fonds soit vir&eacute;.Si vous &ecirc;tes int&eacute;ress&eacute;, alors n&rsquo;h&eacute;sitez &agrave; me contacter sur mon mail qui est: nicolasdupont900@gmail.com<br /><br />', 31, 5, '2014-05-29 04:13:15', 'upload/8062/emprunt.jpg;', 'off', 'off', 'validee', 'off', 'on'),
(8063, 138, 'sérieuse offre de prêt entre particulier', '<br /> Bonjour je dispose d&rsquo;un capital qui servira &agrave; octroyer des pr&ecirc;ts<br /> particuliers &agrave; court et long terme allant de 2000 &agrave; 800.000? &agrave; toute personne<br /> s&eacute;rieuse voulant de ce pr&ecirc;t. 2% &agrave; 4% d&rsquo;int&eacute;r&ecirc;t l&rsquo;an selon la somme pr&ecirc;t&eacute; car<br /> &eacute;tant particulier je ne veux pas violer la loi sur l&rsquo;usure. Veuillez nous pr&eacute;ciser dans vos<br /> demandes de pr&ecirc;t le montant exact que vous souhaiteriez et la date.<br /> Veuillez nous &eacute;crire pour vos pr&ecirc;ts personnels :denis_vezier@outlook.fr<br /> Sigmas Cr&eacute;dit &agrave; vos services 24/24 Heures<br /> P.S: je ne pr&ecirc;te qu''aux personnes susceptibles de me rembourser.', 31, 2000, '2014-05-29 09:28:05', 'upload/8063/1000959-1422105654698250-1954654339-n.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
