(8067, 140, 'Offre de prêt entre particulier sérieux ', 'Bonjour Mr Je dispose d''un capital qui servira &agrave; octroyer des pr&ecirc;ts particulier &agrave; court et long terme allant de 2000 &euro; &agrave; 1.350.000 &euro; &agrave; toute personne s&eacute;rieuse voulant de ce pr&ecirc;t partout dans le monde. Mon taux d''int&eacute;r&ecirc;t est 3% l''an selon la somme pr&ecirc;t&eacute; car &eacute;tant particulier je ne veux pas violer la loi sur l''usure. Vous pouvez rembourser sur 1 &agrave; 25 ans maximum selon la somme pr&ecirc;t&eacute;. c''est &agrave; vous de voir pour les mensualit&eacute;s. Je ne demande qu''une seule reconnaissance de dette certifi&eacute;e manuscrite et aussi quelques pi&egrave;ces &agrave; fournis. Alors pour avoir un pr&ecirc;t , veuillez vite prendre contacte avec moi sur mon Email: (sona300@hotmail.com)', 31, 1, '2014-05-29 11:48:19', 'upload/8067/-35-1-.JPG;', 'off', 'off', 'validee', 'off', 'on'),
(8068, 141, 'Offre de crédit entre Particulier ', '<div>Bonsoir Mr, Mme et Mlle Je mets &agrave; votre disposition un pr&ecirc;t &agrave; partir de 500 a 485.000&euro; &agrave; des conditions tr&egrave;s simple &agrave; toutes personnes pouvant rembourser. Avec un taux de 2% par ans L''honn&ecirc;tet&eacute; et la franchisse sont les deux choses qui manquent le plus sur le net ,Je r&eacute;serve &agrave; mes clients un accueil parfait bas&eacute; sur le respect, la courtoisie et le meilleur des services, J''ai la qualification n&eacute;cessaire pour vous aider dans vos projet. J''offre de pr&ecirc;ts aux Particuliers ; Co-exploitation et organismes qui ont besoin de pr&ecirc;ts pour les petites Pour plus informations vous pouvez me contacter par E-mail: <strong class="gb4">brigitte.alcaraz.savino02@gmail.com</strong>&nbsp;N.B : Ou par tel : 07 86 60 62 43 &nbsp;Je r&eacute;p&egrave;te, pas s&eacute;rieux s&rsquo;abstenir .</div><br />\r\n<div>&nbsp;</div>', 31, 100, '2014-05-31 14:58:37', 'upload/8068/1.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8069, 141, 'Offre de crédit ', '<div>Bonsoir Mr, Mme et Mlle Je mets &agrave; votre disposition un pr&ecirc;t &agrave; partir de 500 a 485.000&euro; &agrave; des conditions tr&egrave;s simple &agrave; toutes personnes pouvant rembourser. Avec un taux de 2% par ans L''honn&ecirc;tet&eacute; et la franchisse sont les deux choses qui manquent le plus sur le net ,Je r&eacute;serve &agrave; mes clients un accueil parfait bas&eacute; sur le respect, la courtoisie et le meilleur des services, J''ai la qualification n&eacute;cessaire pour vous aider dans vos projet. J''offre de pr&ecirc;ts aux Particuliers ; Co-exploitation et organismes qui ont besoin de pr&ecirc;ts pour les petites Pour plus informations vous pouvez me contacter par E-mail: <strong class="gb4">brigitte.alcaraz.savino02@gmail.com</strong>&nbsp;N.B : Ou par tel : 07 86 60 62 43 &nbsp;Je r&eacute;p&egrave;te, pas s&eacute;rieux s&rsquo;abstenir .</div><br />\r\n<div>&nbsp;</div>', 25, 80, '2014-05-31 15:01:28', 'upload/8069/1.jpg;', 'off', 'off', 'validee', 'off', 'on'),
(8389, 123, 'Offre de prêt entre particulier en 48h ', 'Bonjour,<br /><br />Je me pr&eacute;sente je suis&nbsp; NAREINEN Murielle&nbsp; , fran&ccedil;aise&nbsp; d''origine r&eacute;unionnaise &acirc;g&eacute; de 71 ans docteur en &eacute;conomie r&eacute;sident en France &agrave; Lit-haire.Je vous contacte juste pour vous proposer mes services d''octroie de cr&eacute;dit d''argent partout en France. Je pr&ecirc;te d''argent aux particuliers pour leur permettre de concr&eacute;tiser leurs projets ou de racheter leurs dettes et je per&ccedil;ois en retour un int&eacute;r&ecirc;t raisonnable. Mes services concernent tous les particuliers, qui ont besoin d''argent, ou qui sont m&ecirc;me interdits bancaires ou ceux dont les dossiers sont souvent rejet&eacute;s par les banques. Il s''agit d''un cr&eacute;dit d''argent faire de particulier &agrave; particulier sans intervention de la banque &agrave; un taux moins on&eacute;reux. Trois jours seulement suffisent pour monter votre dossier de pr&ecirc;t et toucher le bout du tunnel. Si vous avez r&eacute;ellement besoin d''emprunter d''argent, contactez moi pour plus de d&eacute;tails. E-mail :&nbsp; pretplusrapide@yahoo.fr&nbsp; ou pretplusrapide@outlook.fr<br /><br />Merci de votre compr&eacute;hension', 31, 100, '2016-01-06 07:59:47', 'upload/8389/PRETPLUS5.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8071, 142, 'prêt immédiat et prets entre particulier', 'vous &ecirc;tes &agrave; la recherche d''un financement pour augmenter vos activit&eacute;s &agrave; la fois pour la r&eacute;alisation d''un projet, en raison de comparative un appartement, mais malheureusement, la banque impose des conditions dont vous &ecirc;tes incapables de remplir, plus de souci, je vous presente une particulier qui offre des pr&ecirc;ts aux personnes en mesure de respecter ses engagements, d''autre part, le taux d''int&eacute;r&ecirc;t est raisonnable de 3%<br />que vous ayez besoin d''argent pour d''autres raisons, n''h&eacute;sitez pas &agrave; la contacter pour plus d''informations.sont mail: souardsaraja@gmail.com', 31, 0, '2014-06-01 18:02:09', 'upload/8071/5a135f93b9d97163cc6f9404c99ef1e3-1-4.jpg;upload/8071/5a135f93b9d97163cc6f9404c99ef1e3-1-4.jpg;', 'off', 'off', 'validee', 'off', 'on'),
