(8088, 123, 'Offre de pret entre particulier plus rap', 'Bonjour,<br />Vous &ecirc;tes fich&eacute;s, interdits bancaires et vous n&rsquo;avez pas la faveur des banques ou mieux vous avez un projet et besoin de financement, un mauvais dossier de cr&eacute;dit ou besoin d&rsquo;argent pour payer des factures, fonds &agrave; investir sur les entreprises. Alors si vous avez besoin de pr&ecirc;t d&rsquo;argent n&rsquo;h&eacute;sitez pas &agrave; me contacter par email:pretplusrapide@yahoo.fr ou pretplusrapide@outlook.fr pour en savoir plus sur mes conditions bien favorable.', 31, 100, '2014-06-03 20:22:35', 'upload/8088/PRET-PLUS.jpg;upload/8088/j1.jpg;', 'off', 'off', 'validee', 'off', 'on'),
(8089, 145, 'Offre de pret entre particulier en 72h', 'Particulier Suisse,canada, belgique portugais italien fran&ccedil;ais Brasil et n''importe ou dans le monde entier nous mettons &agrave; votre disposition un pr&ecirc;t &agrave;<br />partir de 1.000&euro; a 5.000.000&euro; &agrave; des conditions tr&egrave;s simple nous faisons aussi des investissements et des pr&ecirc;ts entre particulier de toutes sortes .nous<br />offrons des cr&eacute;dits &agrave; court, moyen et long terme. Nous ignorons de vos usages et nos transferts sont assur&eacute;s par une banque pour la s&eacute;curit&eacute; de la<br />transaction &agrave; toute personne capable de le rembourser avec int&eacute;ret au taux de 2% pour toute personne int&eacute;resser m''&eacute;crire . Pour toutes vos demandes<br />faites propositions par rapport aux taux et aux &eacute;chelonnements de paiements et je serai &agrave; votre aide. Enfin pour plus de compr&eacute;hension veuillez nous<br />joindre.notre email delacruzfeliciano461@yahoo.fr pour toutes informations', 35, 1, '2014-06-03 22:12:24', 'upload/8089/billets-euro-compte-1-0.jpg;upload/8089/billets-euro-compte-1-0.jpg;', 'off', 'off', 'validee', 'off', 'on'),
(8090, 146, 'Offre de prêt entre particuliers sérieux', '<p>Particuliers ou chef d&rsquo;entreprise du monde entier ou banque<br />priv&eacute;e,suisse,canadien, Belge ,fran&ccedil;ais et autre.<br />vous avez besoin de financements pour la consolidation de vos<br />dettes, Ou de financement pour permettre &agrave; votre entreprise &agrave; se<br />Remettre sur les rails.<br />Alors orientez vous vers nous, et vous trouverez la solution &agrave; vos<br />probl&egrave;mes financiers.<br />Nous sommes &agrave; votre service pour vos demandes de pr&ecirc;t priv&eacute; de<br />2000&euro; &agrave; 5.000.000&euro; &agrave; tout particulier capable de le rembourser avec<br />int&eacute;r&ecirc;ts au taux de 3 % sur une longue p&eacute;riode donn&eacute;; personnes<br />non s&eacute;rieux ( s&rsquo;abstenir ) .<br />Nous sommes dans la mesure de satisfaire votre demande dans<br />les 72 heures au plus tard apr&egrave;s la r&eacute;ception de votre demande de<br />pr&ecirc;t.</p><br />\r\n<p>Contactez- nous uniquement par mail :</p><br />\r\n<p>leonard.denielle@hotmail.fr</p><br />\r\n<p>Pas de s&eacute;rieux s&rsquo;abstenir.</p>', 31, 2000, '2014-06-04 04:14:29', 'upload/8090/00.jpg;', 'off', 'off', 'refusee', 'off', 'on');
