(8099, 147, 'Aide financière aux personnes dans le be', '<p><br />Bonjour Mr et Mme<br />Je fais des offres de pr&ecirc;t pour des personnes ayant un emploi et capable de me rembourser mon argent; mon int&egrave;r&ecirc;t est de 2% abordable pour tout le monde.<br />Vous qui &ecirc;tes a la recherche d''un pr&ecirc;t urgent voici mon email:</p><br />\r\n<p>Email: jessicaackermann@hotmail.fr</p>', 31, 10, '2014-06-05 11:11:41', 'upload/8099/GHM.jpg;upload/8099/GT.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
