(8109, 150, 'Offre de prêt rapide aux particuliers', 'Bonjour Monsieur / Madame<br /><br />Permettez-moi de vous contacter en ce Jour. Je voudrais vous informer que je suis un particulier qui offre des pr&ecirc;ts financiers afin d''aider les personnes dans le besoin. Nous ne sommes pas sans ignores que la crise qu''a connu notre continent a affaiblit nos banques et nos instituts financiers.je vous offre un pr&ecirc;t de 1000&euro; &agrave; 1.000.000&euro; &agrave; toutes personnes capable de le rembourser avec int&eacute;r&ecirc;t au taux de 2% pour toute personne int&eacute;ress&eacute; m&rsquo;&eacute;crire,personne non s&eacute;rieux, s&rsquo;abstenir.Juste honn&ecirc;te et fiable.<br /><br />Contactez-moi : r.lucjean@gmail.com<br /><br />Cordialement<br /><br /><br />', 32, 1, '2014-06-08 19:59:33', 'upload/8109/TTTTTTTTTTTTTT.jpeg;', 'off', 'off', 'refusee', 'off', 'on'),
(8110, 150, 'Aide fiancière à tous', 'je vous offre un pr&ecirc;t de 1000&euro; &agrave; 1.000.000&euro; &agrave; toutes personnes capable de le rembourser avec int&eacute;r&ecirc;t au taux de 2% pour toute personne int&eacute;ress&eacute; m&rsquo;&eacute;crire,personne non s&eacute;rieux, s&rsquo;abstenir.Juste honn&ecirc;te et fiable.<br /><br />Contactez-moi : r.lucjean@gmail.com<br /><br />Cordialement<br /><br /><br />', 31, 0, '2014-06-08 20:00:34', 'upload/8110/RRRRRRRRRRRRRRRRR.jpeg;', 'off', 'off', 'validee', 'off', 'on'),
(8111, 151, 'BESOIN D''UN CREDIT RAPIDE', 'Si vous &ecirc;tes en d&eacute;tresse financi&egrave;re, fich&eacute;s, interdits bancaires,<br />regroupement de cr&eacute;dits etc.... Ceci vous concerne o&ugrave; que vous<br />habitiez. (FRANCE, SUISSE, CANADA, BELGIQUE, ITALIE, &Eacute;TATS-UNIS, PORTUGAL,ESPAGNE etc....) Pour tout besoin d''argent contactez moi pour les<br />conditions. Je pr&ecirc;te de 2.000 &agrave; 1.300.000 &euro; au taux de 3% en 48 heures<br />CONTACT : sabinequertainmont1@gmail.com', 31, 0, '2014-06-09 12:58:28', '', 'off', 'off', 'refusee', 'off', 'on'),
(8112, 151, 'offre des prêts d''argents', 'Bonjour, notre soci&eacute;t&eacute; offre des pr&ecirc;ts d''argents de 1.000&euro; &agrave; 1.000.000&euro; &agrave;<br />toute personne de bonne moralit&eacute; d&eacute;sirant acqu&eacute;rir pour en faire de bon<br />usage. Voici les domaines dans lesquels je peux vous aider: * Financier *<br />Pr&ecirc;t immobilier * Pr&ecirc;t &agrave; l''investissement * Pr&ecirc;t automobile * Dette de<br />consolidation * Marge de cr&eacute;dit * Deuxi&egrave;me hypoth&egrave;que * Rachat de cr&eacute;dit *<br />Pr&ecirc;t personnel Alors si vous aviez besoin de pr&ecirc;t d&rsquo;argent entre<br />particulier, n''h&eacute;sitez pas &agrave; me contacter pour en savoir plus sur mes<br />conditions pr&ecirc;t d''argent bien favorable. Personne pas s&eacute;rieux s''abstenir.<br />Email: sabinequertainmont1@gmail.com', 35, 0, '2014-06-09 12:59:18', '', 'off', 'off', 'refusee', 'off', 'on'),
(8113, 151, 'Octroi de prêt entre particulier', 'J''offre des pr&ecirc;t a des personnes d&eacute;sireux et qui sont en<br />difficult&eacute;.mais mon pr&ecirc;t compris entre 1.000&euro; a 600.000&euro;<br />Vous n''avez pas pu obtenir un pr&ecirc;t &agrave; la banque parce que votre cr&eacute;dit<br />ne r&eacute;pond pas &agrave; leurs normes ou que leur conditions sont trop<br />protocolaires ? ?<br />Vous r&ecirc;vez de poss&eacute;der votre propre maison,mais on vous &agrave; refus&eacute; un<br />pr&ecirc;t immobilier??<br />Vous avez des initiatives de d&eacute;veloppement mais les moyens de<br />financement vous font d&eacute;faut .<br />Le service d''octroi de pr&ecirc;t entre particulier &eacute;tend ses services au<br />profit de toutes les classes sociales en offrant des pr&ecirc;ts a toutes<br />personnes physique et morale d''un montant allant de 1.000 &euro; a 600.000&euro;<br />avec un taux d&rsquo;int&eacute;r&ecirc;t bien &eacute;tudier a la baisse. J''avoue que j''aimerai<br />avoir affaire a des personnes s&eacute;rieuses . Pour me contacter: sabinequertainmont1@gmail.com', 35, 0, '2014-06-09 13:01:04', '', 'off', 'off', 'refusee', 'off', 'on'),
(8114, 151, 'OFFRE DE PRET EN 48H', 'Vous &ecirc;tes &agrave; la recherche de capital pour soit relancer vos activit&eacute;s<br />soit pour la r&eacute;alisation d''un projet , soit pour vous acheter un<br />appartement,mais h&eacute;las la banque vous pose des conditions dont vous &ecirc;tes<br />incapables. Plus de souci, moi je suis une particuli&egrave;re et j''octroie des pr&ecirc;ts allant de<br />2.000 &agrave; 500.000 &euro; &agrave; toutes personnes capable de respecter ses engagements par ailleurs le<br />taux d&rsquo;int&eacute;r&ecirc;t est de 3% par l''an. Soit vous avez besoin d''argent pour d''autres raisons.<br />N&rsquo;h&eacute;sitez pas de me contacter pour plus d''informations mail: sabinequertainmont1@gmail.com', 31, 0, '2014-06-09 13:02:18', '', 'off', 'off', 'refusee', 'off', 'on'),
(8115, 151, 'Prêts locaux et des prêts internationaux', 'Particulier suisse, canadien, Belge ou fran&ccedil;ais je vous offre de pr&ecirc;t de 2.000&euro; &agrave; 700.000&euro; &agrave; toute personne capable de le rembourser avec int&eacute;r&ecirc;t a un taux faible de 3%.Nous sommes des particuliers qui offre de pr&ecirc;t entre Particuliers s&eacute;rieux&nbsp; pour les petites entreprises, investissements personnels pour seulement &agrave; 3% d''int&eacute;r&ecirc;t selon le montant demandez. Nous faisons des pr&ecirc;ts locaux et des pr&ecirc;ts internationaux &agrave; des personnes partout dans le monde. Notre organisation peux vous faire un transfert de fond par la banque et nous ne n&eacute;cessitons pas beaucoup de documents. Pr&ecirc;t juste et honn&ecirc;te et fiable. Contactez moi d&egrave;s aujourd''hui et faites moi conna&icirc;tre le montant d''argent que vous voulez pr&ecirc;ter. je suis pr&ecirc;te &agrave; satisfaire.<br />Veuillez me contacter par e-mail: sabinequertainmont1@gmail.com', 35, 0, '2014-06-09 13:02:54', '', 'off', 'off', 'validee', 'off', 'on'),
(8116, 153, 'offres de pret aux pauvres', '<br />Particulier Suisse,canada, belgique portugais italien fran&ccedil;ais Brasil et n''importe ou dans le monde entier nous mettons &agrave; votre disposition un pr&ecirc;t &agrave;<br />partir de 2.000&euro; a 5.000.000&euro; &agrave; des conditions tr&egrave;s simple nous faisons aussi des investissements et des pr&ecirc;ts entre particulier de toutes sortes .nous<br />offrons des cr&eacute;dits &agrave; court, moyen et long terme. Nous ignorons de vos usages et nos transferts sont assur&eacute;s par une banque pour la s&eacute;curit&eacute; de la<br />transaction &agrave; toute personne capable de le rembourser avec int&eacute;ret au taux de 2% pour toute personne int&eacute;resser m''&eacute;crire . Pour toutes vos demandes<br />faites propositions par rapport aux taux et aux &eacute;chelonnements de paiements et je serai &agrave; votre aide. Enfin pour plus de compr&eacute;hension veuillez nous<br />joindre.notre email Almeida.Caldeira@yahoo.fr pour toutes informations<br /><br />', 31, 1, '2014-06-10 21:24:53', 'upload/8116/billets-euro-compte-1-0.jpg;', 'off', 'off', 'validee', 'off', 'on'),
(8117, 146, 'Offre de prêt entre particuliers sérieux', '<p>Plus de soucis pour vous maintenant car je suis l&agrave; pour vous aider.Savez vous que beaucoup de personne dans le monde veulent r&eacute;aliser beaucoup de projet pouvant cr&eacute;er des milliers d''emplois? mais n''ont pas de moyen financier pour d&eacute;buter leur projet. Je pense vous aider avec un financement rapide et fiable.Je dispose d''un capital qui servira &agrave; octroyer des pr&ecirc;ts particulier &agrave; court et long terme allant de 2000 &agrave; 5 000 000 &euro; &agrave; toute personne s&eacute;rieuse voulant de ce pr&ecirc;t. 3% d''int&eacute;r&ecirc;t l''an selon la somme pr&ecirc;t&eacute; car &eacute;tant particulier je ne veux pas violer la loi sur l''usure. Vous pouvez rembourser sur 1 &agrave; 30 ans maximum selon la somme pr&ecirc;t&eacute;.c''est &agrave; vous de voir pour les mensualit&eacute;s. Je ne demande qu''une reconnaissance de dette certifi&eacute;e manuscrite et aussi quelques pi&egrave;ces &agrave; fournis</p><br />\r\n<p>Contactez- nous uniquement par mail : leonard.denielle@hotmail.fr</p><br />\r\n<p>Pas de s&eacute;rieux s''abstenir</p><br />\r\n<p>&nbsp;</p>', 31, 2000, '2014-06-11 17:53:29', 'upload/8117/5396d3fa-09c4-469b-a4f3-7bce2e045071.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
