(8121, 154, 'OFFRE DE PRET ENTRE PARTICULIERS', '<p><br />Offre de pr&ecirc;t d''argent rapide et fiable<br />Besoin d&rsquo;une auto mais personne ne veut vous financer <br />Vous avez fait faillite <br />Une institution financi&egrave;re a repris votre v&eacute;hicule pour d&eacute;faut de paiement <br />Vous avez eu des retards de paiements <br />Vous n&rsquo;avez jamais emprunt&eacute; <br />Vous &ecirc;tes actuellement en faillite non lib&eacute;r&eacute;e <br />Vous avez remis de fa&ccedil;on volontaire votre v&eacute;hicule &agrave; une institution financi&egrave;re <br />Vous &ecirc;tes actuellement en d&eacute;marche avec un syndic de faillite pour une proposition de r&egrave;glement avec vos cr&eacute;anciers <br />Vous avez &eacute;t&eacute; refus&eacute; par une institution financi&egrave;re <br />Vous avez un mauvais cr&eacute;dit<br />Enfin vous avez quelqu''un pour vous soulager. veuillez me contacter et m''adresser votre demande pour que dans un bref d&eacute;lai je puisse vous satisfaire avec un taux raisonnable de 2% et selon la dur&eacute;e de remboursement. &eacute;mail:pothon2014@outlook.fr<br />MERCI</p>', 31, 0, '2014-06-12 08:14:34', 'upload/8121/82.jpg;', 'off', 'off', 'validee', 'off', 'on'),
(8122, 154, 'OFFRE DE PRËT RAPIDE ET FIABLE EN 48 H', '<p>Bonjour</p><br />\r\n<p>je suis un particulier d''experts financiers en mesure de vous faire un<br />pr&ecirc;t allant de 2000 a 50.000.000.00 &euro; pour un taux de 3% l''an a toute<br />personne capable de rembourser et avec des conditions qui vous<br />faciliteront la vie. Voici les domaines dans lesquels je peux vous<br />aider:</p><br />\r\n<p>* Financier<br />* Pr&ecirc;t immobilier<br />* Pr&ecirc;t &agrave; l''investissement<br />* Pr&ecirc;t automobile<br />* Dette de consolidation<br />* Marge de cr&eacute;dit<br />* Deuxi&egrave;me hypoth&egrave;que<br />* Rachat de cr&eacute;dit<br />* Pr&ecirc;t personnel</p><br />\r\n<p>Vous &ecirc;tes fich&eacute;s, interdits bancaires et vous n''avez pas la faveur des<br />banques ou mieux vous avez un projet et besoin de financement, un<br />mauvais dossier de cr&eacute;dit ou besoin d''argent pour payer des factures,<br />fonds &agrave; investir sur les entreprises. Alors si vous avez besoin de<br />pr&ecirc;t d''argent n''h&eacute;sitez pas &agrave; me contacter pour en savoir plus sur mes<br />conditions bien favorable.<br />Personne pas s&eacute;rieux s''abstenir<br />merci de me contacte pas mail: pothon2014@outlook.fr<br />Cordialement<br />Mr Jacomet</p>', 31, 0, '2014-06-12 08:15:32', 'upload/8122/82.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8123, 1, '100 DVD films divers', 'Une centaine de DVD de films divers sont &agrave; vendre.<br />Louis de funes, bourvil, alain delon, gabin, belmondo, pierre richards etc ....<br /><br /><br />', 20, 50, '2014-06-12 10:28:45', '', 'on', 'off', 'validee', 'on', 'on'),
(8124, 155, 'pret entre particulier sérieux', '<p>Bonjour</p><br />\r\n<p>Vous &ecirc;tes un particulier, &agrave; la recherche d&rsquo;un pr&ecirc;t avec le TEG annuel fixe : 2 % sur la somme &agrave; emprunter. J''offre &agrave; toutes personnes des prets allant de 1000 &agrave; 10.000.000&euro; pour la mise en place de vos projets ou pour consolider vos dettes. Je suis dispos&eacute; &agrave; accompagner toute personne s&eacute;rieuse, honn&ecirc;te, dans la r&eacute;alisation de ses projets dans un cadre de collaboration clair et bien d&eacute;fini qui arrange le pr&ecirc;teur et l&rsquo;emprunteur.J''ai besoin de votre r&eacute;ponse urgente si vous &ecirc;tes int&eacute;ress&eacute;.Veuillez me contacter &agrave; cette adresse e-mail: yves_blanc@yahoo.fr</p>', 31, 12, '2014-06-12 18:50:08', 'upload/8124/17486-1.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8125, 156, 'offre de prêt', '<p><br />Bonjour: Monsieur et Madame individu fran&ccedil;ais, nous offre de pr&ecirc;t EURO 4000 EURO 1000000. <br />Personnes s&eacute;rieuses de pr&ecirc;t entre biblioth&egrave;ques qui sont dans le besoin pour les petits entreprises, investissements personnels pour seulement 2% &agrave; 4% <br />int&eacute;r&ecirc;t pour le montant requis pour voter. Nous faisons des pr&ecirc;ts locaux et des pr&ecirc;ts internationaux &agrave; des personnes partout dans le monde. Notre organisation n''est pas une banque et ne n&eacute;cessitons de nombreux documents. Juste et honn&ecirc;te et pr&ecirc;t <br />fiable. Contactez-moi d&egrave;s aujourd''hui et faites-moi savoir la quantit&eacute; d''argent que vous voulez payer, je suis pr&ecirc;t &agrave; r&eacute;pondre. <br />Voici mon adresse e-mail: jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 00:49:06', 'upload/8125/5.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8126, 156, ' offre de prèt entre particulier', '<p><br />Bonjour,<br />Monsieur &amp; Madame, Vous aviez besoin de pr&ecirc;ts d''argent pour faire face aux difficult&eacute;s financi&egrave;res pour enfin sortir de l''impasse que provoquent les banques, par le rejet de vos dossiers de demande de cr&eacute;dits ? Je suis un particulier d''experts financi&egrave;res en mesure de vous faire un pr&ecirc;t a un montant dont vous avez besoin et avec des conditions qui vous faciliteront la vie. Voici les domaines dans lesquels je peux vous aider: Financier Pr&ecirc;t immobilier, Pr&ecirc;t &agrave; l''investissement , Dette de consolidation, Marge de cr&eacute;dit ,Deuxi&egrave;me hypoth&egrave;que, Rachat de cr&eacute;dit, Pr&ecirc;t personnel Vous &ecirc;tes fich&eacute;s, interdits bancaires et vous n''avez pas la faveur des banques ou mieux vous avez un projet et besoin de financement, un mauvais dossier de cr&eacute;dit ou besoin d''argent pour payer des factures, fonds &agrave; investir sur les entreprises. J''offre de 1000&euro; &agrave; 5.000.000&euro;, . Veuillez me contacter directement par &eacute;mail : jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:01:44', 'upload/8126/6.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8127, 156, ' Pourquoi vous voulez un prêt?', '<p>-Pourquoi vous voulez un pr&ecirc;t?<br />-Vous habitez ou ?<br />-De combien avez vous besoin?<br />-Comment comptez vous me rembourser et sous combien de temps ?<br />-Avez vous d&eacute;j&agrave; emprunt&eacute;?<br />NB: Mon taux d''int&eacute;r&ecirc;t est de 2.5%<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:03:42', 'upload/8127/1.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8128, 156, ' Vous qui êtes dans le besoin des prêts ', '<p>Vous qui ont besoin d''un pr&ecirc;t sp&eacute;cial que vous avez<br />Difficult&eacute;s &agrave; obtenir des pr&ecirc;ts aupr&egrave;s des banques pour un ou<br />autre raison<br />. &Ecirc;tes-vous un homme ou femme d''affaires?<br />Vous avez besoin d''argent pour d&eacute;marrer votre propre entreprise?<br />Avez-vous besoin de pr&ecirc;t pour r&eacute;gler vos dettes ou de votre<br />Payer des factures ou<br />commencer une belle entreprise?<br />Vous avez un faible pointage de cr&eacute;dit et vous avez des difficult&eacute;s<br />Capital, de pr&ecirc;ts aupr&egrave;s des banques locales et autres<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:06:03', 'upload/8128/6.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8129, 156, 'voulez-vous reglez vos problèmes financi', '<p>Bonjour<br />Je me permets de vous contactez afin de vous offrir mes servir en temps que pr&ecirc;teuse particuli&egrave;re. Mon taux est de 3% avec des conditions tr&egrave;s abordable et une satisfaction sous 72 heures &agrave; compter de la signature du contrat de pr&ecirc;t. je vous transmet directement &agrave; la banque<br />Si int&eacute;resser merci de me contacter: jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:07:48', 'upload/8129/3.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8130, 156, ' Besoin d''argent pour vos projets?', '<p>Je suis directeur d''une soci&eacute;t&eacute; en partenariat avec les banques, nous avons<br />entre les pr&ecirc;ts avec un certain taux d''int&eacute;r&ecirc;t de 4%.<br />Vous &ecirc;tes dans le monde de l''entreprise<br />Vous avez besoin d''argent pour financer vos projets<br />Vous avez besoin d''un pr&ecirc;t pour r&eacute;gler vos dettes, payer<br />Vos factures<br />Ou d&eacute;marrer votre propre entreprise<br />Vous avez un faible pointage de cr&eacute;dit et<br />Avez-vous des probl&egrave;mes avec les banques ou les institutions locales<br />Financier:jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:10:04', 'upload/8130/3.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8131, 156, 'Aide aux personnes en détresse', '<p>J''offre mon soutient au personnes en detresse en leur octroyant un cr&eacute;dit &agrave; un taux tr&egrave;s appr&eacute;ciable.<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:12:57', 'upload/8131/6.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8132, 156, ' Bonjour Madame et Monsieur', '<p>Bonjour Madame et Monsieur<br />Vous etes a la recherche de pr&egrave;t d''argent pour soit relancer vos activit&eacute;s soit pour la r&eacute;alisation d''un projet , soit pour vous acheter un appartement mais h&eacute;las la banque vous pose a des conditions dont vous &ecirc;tes incapables de s de souci moi je suis un particulier et j&rsquo;octroie des pr&ecirc;ts allant de 1000 &euro; jusqu''&agrave; 10.000.000 &euro; a toutes personnes capable de respecter ses ailleurs le taux d&rsquo;int&eacute;r&ecirc;t est de 3% l''an. soit vous avez besoin d''argent pour d''autres raisons ; n''hesietez pas de me contacter pour plus d''informations. Merci de me contacte &agrave; cet mail: jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:15:48', 'upload/8132/5.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8133, 156, 'Offre de prêt rapide et honnête - 1.500.', '<p>Bonjour,<br />offre a toute personnes ayant dans le besoin (Espagne,Belgique,<br />France ,canada,suisse et partout dans le monde) Je mets &agrave; votre disposition un pr&ecirc;t &agrave; partir de<br />2000&euro; a 1.500.000&euro; &agrave; des conditions tr&egrave;s simple &agrave; toutes personnes<br />pouvant rembourser. Avec un taux de 3% par ans . Je fais aussi des<br />investissements et des pr&ecirc;ts entre particulier de toutes sortes .<br />J&rsquo;offre des cr&eacute;dits &agrave; court, moyen et long terme en collaboration avec<br />mon avocat et une dur&eacute;e de remboursement abordable.Nous ignorons de<br />vos usages et nos transferts sont assur&eacute;s par une banque pour la<br />s&eacute;curit&eacute; de la transaction. Pour toutes vos demandes faites<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:20:32', 'upload/8133/1.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8134, 156, 'Faire face aux difficultés financières a', '<p>Bonjour Madame et Monsieur<br />Je suis un particulier fran&ccedil;ais qui offre de pr&ecirc;t d''argent entre particulier de 1000 &euro; jusqu''&agrave; 10.000.000 &euro; &agrave; toute personne capable de le rembourser avec int&eacute;r&ecirc;t a un taux faible de 3% . Nous faisons des pr&ecirc;ts locaux et des pr&ecirc;ts internationaux &agrave; des personnes partout dans le monde. Notre organisation n''est pas une banque et nous ne n&eacute;cessitons pas beaucoup de documents. Pr&ecirc;t juste et honn&ecirc;te et fiable. Contactez moi d&egrave;s aujourd''hui et faites moi conna&icirc;tre le montant d''argent que vous voulez pr&ecirc;ter et la dur&eacute;e de votre pr&ecirc;t. je suis pr&egrave;s &agrave; vous satisfaire. merci de me contacter par mail : jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:22:39', 'upload/8134/4.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8135, 156, 'Offre de prêt d''argent aux particuliers ', '<p>Bonjour,</p><br />\r\n<p>Vous voulez r&eacute;aliser un projet de votre r&ecirc;ve, vous voulez une maison pour votre famille ou vous avez des dettes et des factures &agrave; r&eacute;gler.</p><br />\r\n<p>Les banques ne veulent pas vous satisfaire et vous ne saviez plus &agrave; quel saint vou&eacute;, je suis la solution &agrave; vos probl&egrave;mes financiers.</p><br />\r\n<p>J''accorde des aides financi&egrave;res allant de 5000&euro; &agrave; 150 000&euro; avec un taux d''int&eacute;r&ecirc;t de 2% l''an.<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:25:15', 'upload/8135/3.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
