(8140, 156, ' Concernant une aide financière très fia', '<p><br />Bonsoir Mr/ Mme<br />Si votre demande de pr&ecirc;t d''argent vous est toujours n&eacute;cessaire et d''actualit&eacute; alors prenez contact avec nous afin que nous puissions vous aidez a trouver une<br />solution.<br />Voici notre adresse mail: jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:35:08', 'upload/8140/6.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8141, 156, ' 1000-2000000 offre à toute personne', '<p>Surtout suisse, canadien, belge ou fran&ccedil;ais 1000-2000000 offre &agrave; toute personne capable de le rembourser avec int&eacute;r&ecirc;t a un taux faible de 4%. Nous sommes des individus qui sont dans le besoin pour les petits entreprises, investissements personnels pour seulement un int&eacute;r&ecirc;t de 4% par demande email: jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:37:09', 'upload/8141/3.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8142, 156, 'OFFRE DE PRÊT DE FINANCEMENT DE VOS PROJ', '<p>Particulier Fran&ccedil;ais offrant des pr&ecirc;ts &eacute;tudiants, financement et<br />investissement &agrave; cours, moyens et &agrave; long termes.<br />Je tiens &agrave; vous dire que je suis dispos&eacute; &agrave; vous octroyer un pr&ecirc;t<br />compris entre 10.000 et plus de 10.000000 EURO euro dont j''ai un capital<br />dispos&eacute; pour cela d'' environ 15.000000 EURO.<br />Alors faire des pr&ecirc;ts tout en faisant tourner ce capital, m''aideras<br />aussi a augmenter mes dividendes.<br />En bref, c''est un peu un justificatif des nombreux pr&ecirc;ts que je fais.<br />Je ne voudrais en aucun cas violer la loi sur l''usure.<br />Pour ce fait, Vous pourriez rembourser sur un d&eacute;lai de 25 ans maximum,<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:39:39', 'upload/8142/5.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8143, 156, ' Offre fiable de prêt entre particuliers', '<p>Offre fiable de pr&ecirc;t entre particuliers en 72heures</p><br />\r\n<p>Vous qui &ecirc;tes dans un grand besoin d''argent pour la r&eacute;alisation de vos diff&eacute;rents sortes de projets je suis un particulier certifi&eacute;, l&eacute;gitim&eacute; par la loi et disponible &agrave; vous accorder un pr&ecirc;t allant des 1000 &agrave; 2.800.000 Euros pour un taux forfaitaire de 5%</p><br />\r\n<p>Alors pour tous vos besoins de pr&ecirc;t n''h&eacute;sitez pas &agrave; me contacter directement par mon adresse e-mail:jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:43:26', 'upload/8143/5.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8144, 156, ' Offre de prêt entre particulier et fina', 'Je suis un particulier qui offre des pr&ecirc;ts &agrave; l&rsquo;international. Disposant d''un capital qui servira &agrave; octroyer des pr&ecirc;ts entre particuliers &agrave; cour et long terme allant de 3000 &euro; &agrave; 5000.000 &euro; &agrave; toutes personnes s&eacute;rieuses voulant de ce pr&ecirc;t, le taux d''int&eacute;r&ecirc;t est de 2% l''an selon la somme pr&ecirc;t&eacute;e car &eacute;tant particulier je ne veux violer la loi sur l''usure Vous pouvez rembourser sur 1 &agrave; 30 ans maximum selon la somme pr&ecirc;t&eacute;. Quand aux mensualit&eacute;s ils vous reviens le libre choix.donc me contacter par mon email : &nbsp;jorgesabri@outlook.fr', 31, 0, '2014-06-14 01:45:23', 'upload/8144/3.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8145, 156, 'La solution à touts vos problèmes finaci', '<p>Plus de soucis pour vous maintenant car je suis l&agrave; pour vous aider.Savez vous que beaucoup de personnes dans le monde veulent r&eacute;aliser beaucoup de projet pouvant cr&eacute;er des milliers d''emplois? mais n''ont pas de moyen financier pour d&eacute;buter leurs projets. Voici les domaines dans lesquels nous pouvons vous aider:jorgesabri@outlook.fr</p><br />\r\n<p>Financier<br />Pr&ecirc;t immobilier<br />Pr&ecirc;t &agrave; l''investissement<br />Dette de consolidation</p>', 31, 0, '2014-06-14 01:50:41', 'upload/8145/5.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8146, 156, 'Offre de prêt entre particulier - 1€', '<p>Bonjour <br />Particuliers de la Belgique , je vous offre un pr&ecirc;t de 3000 Euros &agrave; 100.000 Euros &agrave; toutes personnes capables de le rembourser avec int&eacute;r&ecirc;t au taux d''int&eacute;r&ecirc;t allant de &euro;%<br />&agrave; 2%. Selon le montant demand&eacute; le fais ce dans le domaine<br />-pr&ecirc;t Financier<br />- Pr&ecirc;t immobilier<br />- Pr&ecirc;t &agrave; l''investissement<br />- Pr&ecirc;t automobile<br />- Dette de consolidation<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 01:54:45', 'upload/8146/6.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8147, 156, 'Offre de prêt entre particulier', '<p>offre a toute personnes ayant dans le besoin (Espagne,Belgique,<br />France et partout dans le monde ) Je mets &agrave; votre disposition un pr&ecirc;t &agrave; partir de<br />2000&euro; &agrave; 100.00.000&euro; &agrave; des conditions tr&egrave;s simple &agrave; toutes personnes<br />pouvant rembourser. Avec un taux de 3% par ans . Je fais aussi des<br />investissements et des pr&ecirc;ts entre particulier de toutes sortes .<br />J&rsquo;offre des cr&eacute;dits &agrave; court, moyen et long terme en collaboration avec<br />mon avocat et une dur&eacute;e de remboursement abordable.Nous ignorons de<br />vos usages et nos transferts sont assur&eacute;s par une banque pour la<br />s&eacute;curit&eacute; de la transaction. Pour plus d''informations , E-mail :jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 02:03:44', 'upload/8147/3.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8148, 156, 'Offre de pret', '<p>Bonjour</p><br />\r\n<p>Si vous avez besoin de pr&ecirc;ts entre particuliers pour faire face aux difficult&eacute;s<br />financi&egrave;res nous sommes un groupe d''experts financiers en mesure de vous faire un pr&ecirc;t au montant dont vous avez besoin et le rembourser avec int&eacute;r&ecirc;t a un<br />taux faible de 3% avec des conditions qui vous faciliteront la vie. Nous pouvons vous aider dans plusieurs domaines parmi lesquels</p><br />\r\n<p>*Pr&ecirc;t Financier<br />* Pr&ecirc;t immobilier<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 02:05:37', 'upload/8148/5.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8149, 156, 'offre de bien', '<p>Bonjour</p><br />\r\n<p>Si vous avez besoin de pr&ecirc;ts entre particuliers pour faire face aux difficult&eacute;s<br />financi&egrave;res nous sommes un groupe d''experts financiers en mesure de vous faire un pr&ecirc;t au montant dont vous avez besoin et le rembourser avec int&eacute;r&ecirc;t a un<br />taux faible de 3% avec des conditions qui vous faciliteront la vie. Nous pouvons vous aider dans plusieurs domaines parmi lesquels</p><br />\r\n<p>*Pr&ecirc;t Financier<br />* Pr&ecirc;t immobilier<br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 02:07:09', '', 'off', 'off', 'refusee', 'off', 'on'),
(8150, 156, ' * Financier * Prêt immobilier * Prêt à', '<p>Voici les domaines dans lesquels je peux vous aider: <br />* Financier <br />* Pr&ecirc;t immobilier <br />* Pr&ecirc;t &agrave; l''investissement <br />* Pr&ecirc;t automobile <br />* Dette de consolidation <br />* Marge de cr&eacute;dit <br />* Deuxi&egrave;me hypoth&egrave;que <br />* Rachat de cr&eacute;dit <br />* Pr&ecirc;t personnel <br />jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 02:08:55', 'upload/8150/6.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8151, 156, ' Je suis un preteur d', '<p><br />je m''appelle Mme Lucie et je suis un grand preteur international qui est en mesusu de vous preter d''argens pour le financement de vos besoin et la realisation parfaites de vos projets.<br />Pour plus d''informations contacter moi sur : jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 02:13:41', 'upload/8151/5.jpg;', 'off', 'off', 'refusee', 'off', 'on');
