(8152, 156, 'Offre de prêt d''argent entre particulier', '<p><br />Vous &ecirc;tes a la recherche de pr&ecirc;t pour soit relancer vos activit&eacute;s soit pour la r&eacute;alisation d''un projet , soit pour vous acheter un appartement mais h&eacute;las la banque vous pose a des conditions dont vous &ecirc;tes incapable, plus de souci moi je suis un particulier j''octroie des pr&ecirc;ts allant de 1000 &agrave; 500 000 &euro; a toutes personnes avec un taux de 3% l''an. N&rsquo;h&eacute;sitez pas de me contacter pour plus d''informations.<br />Pour toutes vos demande veuillez contacter : jorgesabri@outlook.fr</p>', 31, 0, '2014-06-14 02:15:09', 'upload/8152/3.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
