(8167, 193, 'offre de prét pour tout le monde', 'offre de pr&eacute;t pour tout le monde<br /><br />Je suis un particulier Directeur de l''entreprise de finance et j''offre de pr&ecirc;t aux particuliers ayant besoin de cr&eacute;dit pour leur projet ou leurs activit&eacute;s priv&eacute;es o&ugrave; bien pour payer les dettes ou factures. je suis disponible &agrave; vous accorder ce pr&ecirc;t avec un taux d''int&eacute;r&ecirc;t fixe de 3% l''an. Mon offre varie de 3.000&euro; jusqu''&agrave; 900.000&euro;. Donc particuliers int&eacute;ress&eacute;s alors veuillez bien me contacter sur mon mail.celine.foly@gmail.com', 31, 78000, '2014-07-27 20:34:51', 'upload/8167/images.jpg;', 'on', 'on', 'refusee', 'on', 'on'),
(8168, 194, '  offre de prêt entre particulier sérieu', 'Bonjour<br />Avez-vous besoin de pr&ecirc;t pour r&eacute;gler des dettes ou de payer vos factures ou de commencer une belle entreprise? <br />vous avez un faible pointage de cr&eacute;dit et il devient difficile d''obtenir un pr&ecirc;t&nbsp; Je vous offre de pr&ecirc;t allant de 500&euro; &agrave;<br />&nbsp;500.000.000&euro; sous une dur&eacute;e de 5 &agrave; 30ans selon le montant demand&eacute; avec un taux d&rsquo;int&eacute;r&ecirc;t annuel fixe tr&egrave;s int&eacute;ressant de 2 % pour tous les montants demand&eacute;s.Pour plus d''informations.<br />&nbsp;je reste a votre disposition.veillez me contacter par : medardalain11@gmail.com', 35, 20, '2014-08-01 12:47:14', 'upload/8168/1.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8169, 194, '   offre de prêt entre particulier série', 'Bonjour<br />Avez-vous besoin de pr&ecirc;t pour r&eacute;gler des dettes ou de payer vos factures ou de commencer une belle entreprise? <br />vous avez un faible pointage de cr&eacute;dit et il devient difficile d''obtenir un pr&ecirc;t&nbsp; Je vous offre de pr&ecirc;t allant de 500&euro; &agrave;<br />&nbsp;500.000.000&euro; sous une dur&eacute;e de 5 &agrave; 30ans selon le montant demand&eacute; avec un taux d&rsquo;int&eacute;r&ecirc;t annuel fixe tr&egrave;s int&eacute;ressant de 2 % pour tous les montants demand&eacute;s.Pour plus d''informations.<br />&nbsp;je reste a votre disposition.veillez me contacter par : medardalain11@gmail.com', 31, 20, '2014-08-01 12:51:13', 'upload/8169/1.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8170, 195, 'Accord de crédit entre particuliers sans', '<br />Vous &ecirc;tes &agrave; la recherche d''un cr&eacute;dit,pr&ecirc;t ( Consommation , r&eacute;novation , immobilier , affaire etc..) <br />Nous vous apportons le financement n&eacute;cessaire dont vous avez besoin &agrave; un taux concurrentiel de 2,20% <br />l''an avec un accord de principe sous 48h certifier avec un contrat notari&eacute; &agrave; la cl&eacute;. <br />Veuillez me contacter directement par Email : patrick.bousseau@outlook.fr<br />Tout documents bancaires seront &agrave; votre disponibilit&eacute; une fois le virement effectu&eacute;. <br />Certificat de d&eacute;p&ocirc;t banque Certificat de fonds Attestation d''assurance etc.. PS : <br />Sachez que la transaction ce passe en France ou en Belgique Cordialement...', 31, 10, '2014-08-01 15:52:44', 'upload/8170/images-1-.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
