(8176, 157, ' offre de pret entre particulier en 48h ', 'Bonjour Monsieur &amp; Madame Particulier Suisse,canada, Belgique ou fran&ccedil;ais je vous offre de pr&ecirc;t de 500&euro; &agrave; 10000000&euro; en 48H &agrave; toute personne capable de le rembourser,avec int&eacute;r&ecirc;t au taux de 3% pour toute personne int&eacute;resser m''&eacute;crire , Nous sommes des particuliers qui offre de pr&ecirc;t entre Particuliers s&eacute;rieux qui ont besoin pour les petits entreprises, investissements personnels pour seulement &agrave; 1.5%, Merci de contacter', 31, 2, '2014-08-13 20:38:50', 'upload/8176/sfs.jpg;upload/8176/fdgd.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8390, 296, 'OBTENEZ VOS CRÉDIT EN TOUTE SÉCURITÉ', '<p>OBTENEZ VOS CR&Eacute;DIT EN TOUTE S&Eacute;CURIT&Eacute; Les offres de pr&ecirc;t entre particuliers existent r&eacute;ellement car si j''ai retrouv&eacute; le sourire apr&egrave;s plusieurs rejets de dossier &agrave; la banque, j''ai connu de par l''aide d''un ami une dame formidable qui m''a accord&eacute; un pr&ecirc;t de 20.000 &euro; sans aucune complication. Et en guise de reconnaissance que je fais ce t&eacute;moignage pour accro&icirc;tre sa client&egrave;le et aussi aider ceux qui sont dans de soucis financier. Alors vous qui &ecirc;tes interdits bancaires, vous qui avez besoin de financement pour vos soucis personnels, plus de soucis Prenez juste contacte avec Mme stephanie couvrette Sont &Eacute;mail est : stephanie.couvrette00@gmail.com Passer ce message &agrave; vos proches et amis qui sont dans le besoin de finacement bonne chance a vous.</p>', 31, 1, '2016-01-07 02:47:46', 'upload/8390/hia.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
