(8392, 293, 'Prêt Sérieux et Rapide ', 'Bonjour et bonne ann&eacute;e &agrave; vous,<br /><br />&Ecirc;tes-vous &agrave; la recherche d''un financement pour soit relancer vos activit&eacute;s, soit pour la r&eacute;alisation d&rsquo;un projet, soit pour vous acheter un appartement ou une voiture ? Plus de souci, je vous soumets une offre de pr&ecirc;t entre particuliers de 5 000 &agrave; 500 000 euros &agrave; toutes personnes s&eacute;rieuse et sinc&egrave;re capable de me rembourser &agrave; un taux d&rsquo;int&eacute;r&ecirc;t annuel de 2,20%. <br />Vous avez besoin d&rsquo;argent URGENT pour d&rsquo;autres raisons, n''h&eacute;sitez pas &agrave; m''&eacute;crire pour avoir plus de renseignements.<br /><br />E-mail : nathalie.caravella@yahoo.fr', 31, 1, '2016-01-09 13:25:24', 'upload/8392/offre-de-pret-de-2000-euro-250000-euro-1.jpg;upload/8392/nathalie.caravella-yahoo.fr.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8178, 196, 'Offre de pret d''argent rapide entre part', '<p>J''ai un usage sp&eacute;cial de subvention en capital &agrave; court ou &agrave; long terme allant de 1500&euro; &agrave; 10 millions &euro; &agrave; toute personne qui veut s&eacute;rieusement ce pr&ecirc;t pr&ecirc;ts . Taux d''int&eacute;r&ecirc;t de 2 % selon le montant annuel pay&eacute; pour &ecirc;tre en particulier ne veulent pas enfreindre la loi contre l''usure . Vous pouvez payer plus de 3 &agrave; 25 ans selon le montant emprunt&eacute; . c''est &agrave; vous de paiements mensuels . Il suffit de demander la reconnaissance d''&eacute;criture et certifi&eacute;e fournit des pi&egrave;ces de la dette .</p>', 31, 10, '2014-08-22 15:13:02', 'upload/8178/images.jpg;upload/8178/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8179, 196, 'Offre de prèt aux personnes et entrepris', '<p>Ce message s''adresse aux particuliers, aux pauvres, ou &agrave; tous ceux qui sont dans le besoin d''un pr&ecirc;t sp&eacute;cial de reconstruire leur vie. Vous cherchez des pr&ecirc;ts pour relancer vos activit&eacute;s soit pour un projet, soit pour acheter un appartement mais ne peut pas bancaires ou dans le dossier ont &eacute;t&eacute; rejet&eacute;es &agrave; la Banque. Je suis une sp&eacute;ciale que j''ai des pr&ecirc;ts allant de personnes de 2 000 &euro; 950 000 en mesure de remplir les conditions. Je ne suis pas une banque et je ne n&eacute;cessite pas beaucoup de documents &agrave; vous faire confiance, mais vous devez &ecirc;tre une personne juste, fiable, honn&ecirc;te et sage. J''accorde des pr&ecirc;ts aux personnes qui vivent en Europe et partout dans le monde (France, Belgique, Canada, Suisse, Roumanie, Italie, Espagne et Portugal...). Mon taux d''int&eacute;r&ecirc;t est de 2 %.Si vous avez besoin d''argent pour d''autres raisons, s''il vous pla&icirc;t n''h&eacute;sitez pas &agrave; me contacter pour plus d''informations. Je suis disponible pour rencontrer mes clients dans une dur&eacute;e pas plus de 3 jours apr&egrave;s la r&eacute;ception de votre demande. Si vous &ecirc;tes int&eacute;ress&eacute;, veuillez me contacter pour plus d''informations</p>', 31, 10, '2014-08-22 15:15:55', 'upload/8179/images.jpg;upload/8179/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8180, 196, 'Opportunité financière de réaliser vos r', '<p>Retrouvez en toute urgence un pr&ecirc;t fiable &agrave; court dur&eacute;e exceptionnelle de 72 heures juste pour aboutir &agrave; vos r&ecirc;ves et vos souhaits les plus aimables. Je mets aux profits de tous les particuliers europ&eacute;ens, un pr&ecirc;t &agrave; la consommation allant de 2000 euros &agrave; 350.000 euros &agrave; taux de 2% quelque soit le montant du pr&ecirc;t.<br />Je serai disponible 24h/24h par email</p>', 31, 10, '2014-08-22 15:16:51', 'upload/8180/images.jpg;upload/8180/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8181, 196, 'Offre de crédit aux particuliers', '<p>Je suis un particulier, qui octroie des pr&ecirc;ts &agrave; toute personne ayant le besoin d''argent et aussi Nous offrons des cr&eacute;dits immobilier et auto mobilier vous qui voulez d&eacute;marrez une activit&eacute; ou ayant des projets ou pour la construction d''un bien ou pour un cr&eacute;dit c''est l''occasion pour y saisir car je serai tr&egrave;s ouverte &agrave; faire ce pr&ecirc;t alors la somme pr&ecirc;t&eacute;e serait rembourser sur un d&eacute;lai de 1 mois a 25 ans &agrave; un taux de 2% pourvue que les r&egrave;gles et les lois en vigueur soit respectez alors si vous &ecirc;tes a la recherche d''un pr&ecirc;t c&rsquo;est l''occasion Pour plus d&rsquo;informations,</p>', 31, 10, '2014-08-22 15:18:01', 'upload/8181/images.jpg;upload/8181/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8182, 196, 'sérieux offre de prêt entre particuliers', '<p>&nbsp;Bonjour Mme/Mr<br />je dispose d''un capital qui servira &agrave; octroyer des pr&ecirc;ts particulier &agrave; court et long terme allant de 1500&euro; &agrave; 2500.000&euro; &agrave; toute personne serieuse voulant de ce pr&ecirc;t. 2% d''int&eacute;r&ecirc;t l''an selon la somme pr&ecirc;t&eacute; car &eacute;tant particulier je ne veux pas violer la loi sur l''usure. Vous pouvez rembourser sur 3 &agrave; 25 ans maximua selon la somme pr&ecirc;t&eacute;. c''est &agrave; vous de voir pour les mensualit&eacute;s. Je ne demande qu''une reconnaissance de dette certifi&eacute;e manuscrite et aussi quelques pi&egrave;ces &agrave; fournis</p>', 31, 10, '2014-08-22 15:18:45', 'upload/8182/images.jpg;upload/8182/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8183, 196, 'offre de prêt entre particuliers sérieux', '<p>Vous avez besoin d''un financement pour votre maison, pour vos affaires, pour achat de voiture, pour l''achat de moto, pour la cr&eacute;ation de vos propres entreprise, pour vos besoins personnels plus de doute. Nous octroyons des cr&eacute;dits personnels allant de 1500 jusqu''&agrave; 10.000.000&euro; avec un taux d''int&eacute;r&ecirc;t nominal de 2% quel que soit le montant. Veuillez nous pr&eacute;ciser dans vos demandes de pr&ecirc;t le montant exact que vous souhaiteriez et la date.&nbsp;</p><br />\r\n<p>Vous avez besoin de faire un pr&ecirc;t, veuillez noter les domaines dans lesquels je peux vous aider:</p><br />\r\n<p>* Financer<br />* Pr&ecirc;ts &agrave; l''investissement<br />* Pr&ecirc;ts immobiliers<br />Dette de consolidation<br />* Pr&ecirc;ts personnels<br />Alors si vous avez besoin de pr&ecirc;t n''h&eacute;sitez pas &agrave; me contacter pour en savoir plus sur mes conditions.<br />Veuillez me contacter directement par E-mail</p>', 31, 10, '2014-08-22 15:19:47', 'upload/8183/images.jpg;upload/8183/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8184, 196, 'Offre de prêt entre particulier sérieux ', '<p>Je suis un homme exp&eacute;riment&eacute;e et tr&egrave;s honn&ecirc;te , je disposant d''un capital important pour aider un bon nombre de personnes dans le besoin d''un pr&ecirc;t . j''offre des pr&ecirc;ts entre particulier de 3000&euro; &agrave; 2. 000. 000&euro; voir plus &agrave; un taux raison 2% selon le montant . Le pr&ecirc;t est plus rapide et ceci est sans paiement de s avez besoin de financement? Vous souhaitez investir , vous voulez acqu&eacute;rir un v&eacute;hicule? Vous avez besoin de tr&eacute;sorerie ?</p>', 31, 10, '2014-08-22 15:20:41', 'upload/8184/images.jpg;upload/8184/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8185, 197, 'Offre de prêt d''argent entre particulier', '<p>&nbsp;</p><br />\r\n<p>Je mets &agrave; votre disposition un pr&ecirc;t &agrave; partir de 5000&euro; &agrave; 50.000.000&euro; &agrave; des<br />conditions tr&egrave;s simple &agrave; toutes personnes pouvant rembourser. Je fais aussi<br />des investissements et des pr&ecirc;ts entre particulier de toutes sortes<br />.J&rsquo;offre des cr&eacute;dits &agrave; court, moyen et long terme en collaboration avec mon<br />avocat et une dur&eacute;e de remboursement abordable. Nous ignorons de vos usages<br />et nos transferts sont assur&eacute;s par une banque pour la s&eacute;curit&eacute; de la<br />transaction. Pour toutes vos demandes faites propositions par rapport aux<br />taux et aux &eacute;chelonnements de paiements et je serai &agrave; votre aide. Enfin<br />pour plus de compr&eacute;hension veuillez me joindre pas e-mail :</p>', 31, 0, '2014-08-24 07:04:21', 'upload/8185/00.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8186, 197, '', '', 0, 0, '2014-08-24 07:05:33', '', 'off', 'off', 'en attente', 'off', 'off'),
(8187, 197, 'Offre de prêt entre particulier sérieux', '<p>Bonjour, Monsieur/Madame</p><br />\r\n<p>Sp&eacute;cial offre de pr&ecirc;t entre particulier Particuliers s&eacute;rieux qui ont besoin<br />pour les petites entreprises, investissements personnels pour seulement 3%<br />d''int&eacute;r&ecirc;t selon le montant demander. Nous faisons des pr&ecirc;ts locaux et des<br />pr&ecirc;ts internationaux &agrave; des personnes partout dans le monde. Contactez-nous<br />d&egrave;s aujourd''hui et faites-nous conna&icirc;tre le montant d''argent que vous<br />voulez pr&ecirc;ter. Nous sommes pr&ecirc;ts &agrave; satisfaire nos clients dans les 72<br />heures suivant la r&eacute;ception de votre demande formul&eacute;e. Si vous &ecirc;tes<br />int&eacute;ress&eacute;s veillez bien nous contactez</p>', 31, 0, '2014-08-24 07:06:28', 'upload/8187/6.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8188, 198, 'Offre de prêt sérieux à un taux de 3%', '<p>Bonsoir Monsieur / Madame</p><br />\r\n<p>Permettez-moi de vous contacter en ce Jour. Je voudrais vous informer que je suis une particuli&egrave;re qui offre des pr&ecirc;ts financiers afin d''aider les personnes qui sont dans le besoin. Nous ne sommes pas sans ignores que la crise qu''a connu notre continent a affaiblit nos banques et nos instituts financiers. J''aimerais vous faire part de mon offre de cr&eacute;dit ou de pr&ecirc;t d''argent entre particulier, ce pr&ecirc;t est &agrave; port&eacute;e de tous, que se soit ch&ocirc;meur, interdit ou fichier bancaire. Je m''adresse aussi aux personnes qui sont dans le besoin et qui recherchent une aide financi&egrave;re afin de voir r&eacute;aliser leurs projets ou d&rsquo;&eacute;ponger leurs dettes. Je vous offre un pr&ecirc;t de 1000&euro; &agrave; 5.000.000&euro; &agrave; toutes personnes capable de le rembourser avec int&eacute;r&ecirc;t au taux de 3% pour toute personne int&eacute;ress&eacute; m&rsquo;&eacute;crire, personne non s&eacute;rieux, s&rsquo;abstenir. Juste honn&ecirc;te et fiable.</p><br />\r\n<p>Cordialement,</p>', 31, 1000, '2014-09-01 18:07:31', 'upload/8188/44.jpg;upload/8188/55.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8189, 199, 'offre de prêt entre particulier', '<p>Bonjour Je suis madame Silvia NEVES une particuliere Portuguaise pouvant octroyer de pr&ecirc;t s&eacute;rieux entre particulier &agrave; toutes personnes susceptible de bien me rembourser.Vous aurez votre pr&ecirc;t dans de bref d&eacute;lai si vous suivez simplement mes conditions.Je ne prend ni frais de dossier ni frais de notaire,merci de me contacter sur mon adresse silvianeves50@yahoo.fr</p><br />\r\n<p>&nbsp;</p>', 31, 0, '2014-09-06 11:55:42', 'upload/8189/1.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8190, 199, 'offre de prêt entre particulier fiable', '<p><br /> Bonjour Je suis madame Silvia NEVES une particuliere Portuguaise pouvant octroyer de pr&ecirc;t s&eacute;rieux entre particulier &agrave; toutes personnes susceptible de bien me rembourser.Vous aurez votre pr&ecirc;t dans de bref d&eacute;lai si vous suivez simplement mes conditions.Je ne prend ni frais de dossier ni frais de notaire,merci de me contacter sur mon adresse silvianeves50@yahoo.fr</p>', 31, 10, '2014-09-06 11:59:57', 'upload/8190/1.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8191, 200, ' Témoignage de pret envers un particulie', 'Bonjour,<br />Tout d&rsquo;abord je vous conseillerais de vous m&eacute;fier des offres sur le net ainsi que les annonces. Car plus de 90% de ces annonces sont frauduleuses. De nos jours il y a de plus en plus d&rsquo;arnaques. Je voulais emprunter de l&rsquo;argent, apr&egrave;s avoir post&eacute; une annonce, chaque jours je re&ccedil;ois plus de 25 messages rien que des escrocs qui demandent de l&rsquo;argent soit disant des frais de dossiers. Et je supprimais leur message mais un jour je suis tomb&eacute; sur une personne nomm&eacute; Gerrard Kermagoret, je croyais qu&rsquo;il faisait parti aussi des escrocs du net mais &agrave; ma grande surprise celui-ci est diff&eacute;rent, il m&rsquo;a fait un pr&ecirc;t de 25.000 euros et je l''ai rembours&eacute; en respectant les d&eacute;lais .Je vous le confirme et si il arrivait que vous recherchez de pr&ecirc;t contactez le par mail. Voici son email : gkermagoret@gmx.fr', 31, 10, '2014-09-08 13:58:09', 'upload/8191/billet.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8192, 200, 'Témoignage de pret acquis', 'Bonjour,<br />Tout d&rsquo;abord je vous conseillerais de vous m&eacute;fier des offres sur le net ainsi que les annonces. Car plus de 90% de ces annonces sont frauduleuses. De nos jours il y a de plus en plus d&rsquo;arnaques. Je voulais emprunter de l&rsquo;argent, apr&egrave;s avoir post&eacute; une annonce, chaque jours je re&ccedil;ois plus de 25 messages rien que des escrocs qui demandent de l&rsquo;argent soit disant des frais de dossiers. Et je supprimais leur message mais un jour je suis tomb&eacute; sur une personne nomm&eacute; Gerrard Kermagoret, je croyais qu&rsquo;il faisait parti aussi des escrocs du net mais &agrave; ma grande surprise celui-ci est diff&eacute;rent, il m&rsquo;a fait un pr&ecirc;t de 25.000 euros et je l''ai rembours&eacute; en respectant les d&eacute;lais .Je vous le confirme et si il arrivait que vous recherchez de pr&ecirc;t contactez le par mail. Voici son email : gkermagoret@gmx.fr<br /><br />', 35, 10, '2014-09-08 13:58:57', 'upload/8192/billet.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8193, 202, 'aide financière à toute personne honnête', 'bonjour mr/mme, obtenir un pr&ecirc;t l&eacute;gitimes a toujours &eacute;t&eacute; un gros<br />probl&egrave;me pour vous. la question du cr&eacute;dit et de la s&eacute;curit&eacute; est<br />quelque chose que les clients sont de plus en plus pr&eacute;occup&eacute;s par la<br />recherche d''un pr&ecirc;t d''un pr&ecirc;teur l&eacute;gitimes. le taux d''int&eacute;r&ecirc;t pour mon<br />pr&ecirc;t est de 2% et le montant minimum que je donne sous forme de pr&ecirc;t<br />est de 1000 &euro; pour laquelle le montant maximum est de 500.000 &euro;. si vous<br />&ecirc;tes int&eacute;ress&eacute;s &agrave; obtenir une aide financi&egrave;re,<br />voici mon adresse mail:<span class="Apple-converted-space"> <br /></span>', 31, 10, '2014-09-10 12:21:29', 'upload/8193/images.jpg;', 'off', 'off', 'refusee', 'on', 'off'),
(8194, 202, 'offre de prêt entre particuliers en fran', 'bonjour<br />vous &ecirc;tes en france en martinique r&eacute;union guadeloupe ou autre,<span class="Apple-converted-space">&nbsp;</span><br />pour vous qui &ecirc;tes fich&eacute;s, interdits bancaires et si vous n''avez pas la<br />faveur des banques et vous avez besoin de pr&ecirc;ter de l''argent entre<br />particulier, nous aidons les gens s&eacute;rieux et honn&ecirc;tes, qui peuvent<br />rembourser le pr&ecirc;t dans le temps normale qu''ils veulent . nous<br />pr&ecirc;tons de 1000&euro; &agrave; 1.350.000&euro; en 48h voir 72h plus tard . nos <br />rebroussement se fait avec un int&eacute;r&ecirc;t de 2 % sur tout la de votre<br />remboursement selon votre demande de pr&ecirc;t. pour plus d''infos<br />contactez nous sur cet adresse mail:', 31, 10, '2014-09-10 12:25:36', 'upload/8194/images-1-.jpg;', 'off', 'off', 'refusee', 'on', 'on'),
(8195, 202, 'offre prêt rapide sûr et fiable dans 48 ', 'je suis un particulier qui offre des pr&ecirc;ts &agrave; l international. disposant d''un capital qui servira &agrave; octroyer des pr&ecirc;ts entre particuliers &agrave; court et long terme allant de 4000 &agrave; 500.000 &agrave; toutes personnes s&eacute;rieuses &eacute;tant dans le r&eacute;el besoin, le taux<br />d''int&eacute;r&ecirc;t est de 2% l''an .j''octroie des pr&ecirc;ts financier , pr&ecirc;t immobilier , pr&ecirc;t &agrave; l''investissement, pr&ecirc;t automobile , pr&ecirc;t personnel . je suis disponible &agrave; satisfaire mes clients en une dur&eacute;e maximale de 48heures suivant la r&eacute;ception de votre formulaire de demande. personne pas s&eacute;rieux s''abstenir', 31, 10, '2014-09-10 12:27:46', 'upload/8195/t-l-chargement.jpg;', 'off', 'off', 'refusee', 'on', 'off'),
(8196, 202, 'pret rapide et fiable', 'bonjour mr et mme<br />ce message s''adresse aux particuliers, aux pauvres, ou &agrave; tous ceux qui sont dans le besoin d''un pr&ecirc;t particulier pour reconstruire leur vie.<br />vous &ecirc;tes &agrave; la recherche de pr&ecirc;t pour soit relancer vos activit&eacute;s soit pour la r&eacute;alisation d''un projet, soit pour vous acheter un appartement mais vous &ecirc;tes interdit bancaire ou votre dossier a &eacute;t&eacute; rejet&eacute; &agrave; la banque. je suis un particulier j&rsquo;octroie des pr&ecirc;ts allant de 2.000 euros &agrave; 300.000.000 &agrave; toutes personnes capable de respecter les conditions. je ne suis pas une banque et je n''exige pas beaucoup de documents pour vous faire confiance, mais vous devez &ecirc;tre une personne juste, honn&ecirc;te, sage et fiable.<br />j''octroie des pr&ecirc;ts aux personnes vivantes dans toutes l''europe et dans le monde entier( france , belgique , suisse , roumanie , italie , espagne , canada , portugal , inde ...). mon taux d&rsquo;octroi d&rsquo;int&eacute;r&ecirc;t est de 3% l''an.<br />si vous avez besoin d''argent pour d''autres raisons, n&rsquo;h&eacute;sitez pas &agrave; me contacter pour plus d''informations. je suis disponible &agrave; satisfaire mes clients en une dur&eacute;e maximale de 5 jours suivant la r&eacute;ception de votre formulaire de demande. et voil&agrave; les domaines financiers dans lesquels j&rsquo;interviens :<br />* pr&ecirc;t immobilier<br />* pr&ecirc;t &agrave; l''investissement<br />* pr&ecirc;t automobile<br />* dette de consolidation<br />* marge de cr&eacute;dit<br />* deuxi&egrave;me hypoth&egrave;que<br />* rachat de cr&eacute;dit<br />* pr&ecirc;t personnel<br />si vous &ecirc;tes int&eacute;ress&eacute;s, veuillez me contacter pour plus d''amples informations.<br />voici mon email :', 31, 10, '2014-09-10 12:28:34', 'upload/8196/t-l-chargement-1-.jpg;', 'off', 'off', 'refusee', 'on', 'off'),
(8197, 202, 'offre prêt rapide sûr et fiable dans 48 ', 'je suis un particulier qui offre des pr&ecirc;ts &agrave; l international. disposant d''un capital qui servira &agrave; octroyer des pr&ecirc;ts entre particuliers &agrave; court et long terme allant de 4000 &agrave; 500.000 &agrave; toutes personnes s&eacute;rieuses &eacute;tant dans le r&eacute;el besoin, le taux<br />d''int&eacute;r&ecirc;t est de 2% l''an .j''octroie des pr&ecirc;ts financier , pr&ecirc;t immobilier , pr&ecirc;t &agrave; l''investissement, pr&ecirc;t automobile , pr&ecirc;t personnel . je suis disponible &agrave; satisfaire mes clients en une dur&eacute;e maximale de 48heures suivant la r&eacute;ception de votre formulaire de demande. personne pas s&eacute;rieux s''abstenir<br />r&eacute;ponse rapide :', 31, 10, '2014-09-10 12:29:26', 'upload/8197/images.jpg;', 'off', 'off', 'refusee', 'on', 'off'),
(8198, 202, 'pret facile à obtenir', 'bonjour<span class="Apple-converted-space">&nbsp;</span><br />je voudrais attirer votre attention sur le fait que je peux vous accorder un pr&ecirc;t sans aucun frais: 1000&euro; &agrave; 10.000.000&euro; remboursables sur une p&eacute;riode de votre choix d'' int&eacute;r&ecirc;t annuel de 2% &agrave; 5 %. vous avez besoin d''un pr&ecirc;t,examinez les domaines dans lesquelles vous avez besoin d''aide : * financement * pr&ecirc;ts immobiliers * pr&ecirc;ts &agrave; l''investissement * pr&ecirc;t automobile * consolidation de la dette * ligne de cr&eacute;dit * seconde hypoth&egrave;que * pr&ecirc;ts personnels<br />donc, si vous avez besoin d''un pr&ecirc;t,n''h&eacute;sitez pas &agrave; me contacter pour de plus amples informations<br />vous &ecirc;tes coinc&eacute;s par la banque alors que vous avez besoin d''un financement pour un projet ou vous avez besoin d''argent pour payer des factures, investir de l''argent dans l''entreprise, payez les dettes.... donc, si vous avez besoin d''un pr&ecirc;t,n''h&eacute;sitez pas &agrave; me contacter pour de plus amples informations. s''il vous plait contacter moi directement par courrier &eacute;lectronique:<span class="Apple-converted-space"> <br /></span>', 31, 10, '2014-09-10 12:31:42', 'upload/8198/t-l-chargement-1-.jpg;', 'off', 'off', 'refusee', 'on', 'off'),
(8199, 202, 'offre de prêt entre particuier', 'bonsoir madame et monsieur<br />particuliers irlande, suisse, canada, belgique , france ,italie partout dans le monde je vous offre un pr&ecirc;t de 2000&euro; &agrave; 10.000 .000&euro; &agrave; toutes personnes capable de le rembourser avec int&eacute;r&ecirc;t au taux d''int&eacute;r&ecirc;t est de 3% pour tout montant demand&eacute; .je le fais ce dans le domaine<br />-pr&ecirc;t financier<br />- pr&ecirc;t immobilier<br />- pr&ecirc;t &agrave; l''investissement<br />- pr&ecirc;t automobile<br />- dette de consolidation<br />- rachat de cr&eacute;dit<br />- pr&ecirc;t personnel<br />-vous &ecirc;tes fich&eacute;s<br />si vous &ecirc;tes vraiment dans le besoin d''un pr&ecirc;t essayer de me contacter.<br />je suis &agrave; votre disposition pour tous vos probl&egrave;mes financier.<br />pour plus de renseignement veuillez nous contacter sur notre adresse', 31, 10, '2014-09-10 12:32:30', 'upload/8199/t-l-chargement.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8200, 202, 'meilleur prêt sans faux frais et sans ba', 'bonjour je dispose d''un capital qui servira &agrave; octroyer des pr&ecirc;ts particulier &agrave; court et long terme allant de 1500 ? &agrave; 10.000.000 ? (dollar canadian ; euro ; &agrave; toute personne s&eacute;rieuse voulant de ce pr&ecirc;t. 2% d''int&eacute;r&ecirc;t l''an selon la somme pr&ecirc;t&eacute; car &eacute;tant particulier je ne veux pas violer la loi sur l''usure. vous pouvez rembourser sur 3 &agrave; 25 ans maximum selon la somme pr&ecirc;t&eacute;. c''est &agrave; vous de voir pour les mensualit&eacute;s. je ne demande qu''une reconnaissance de dette certifi&eacute;e manuscrite et aussi quelques pi&egrave;ces &agrave; fournis. vous avez besoin de faire un pr&ecirc;t, veuillez noter les domaines dans lesquels je peux vous aider: * financer * pr&ecirc;ts immobiliers * pr&ecirc;ts &agrave; l''investissement * pr&ecirc;t automobile * dette de consolidation * marge de cr&eacute;dit * deuxi&egrave;me hypoth&egrave;ques * rachat de cr&eacute;dit.', 31, 10, '2014-09-10 12:33:16', 'upload/8200/images-1-.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8201, 202, 'offre de prêt d’argent sérieux rapide et', 'vous &ecirc;tes &agrave; la recherche d''un cr&eacute;dit,pr&ecirc;t ( consommation , r&eacute;novation , immobilier , affaire etc..) nous vous apportons le financement n&eacute;cessaire dont vous avez besoin &agrave; un taux concurrentiel de 2,20% l''an avec un accord de principe sous 48h certifier avec un contrat notari&eacute; &agrave; la cl&eacute;. veuillez me contacter directement par couriel . tout documents bancaires seront &agrave; votre disponibilit&eacute; une fois le virement effectu&eacute;. certificat de d&eacute;p&ocirc;t banque certificat de fonds attestation d''assurance etc.. ps : sachez que la transaction ce passe en france ou en belgique cordialement.', 31, 10, '2014-09-10 12:34:13', 'upload/8201/images.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8202, 203, 'Obtenez un financement de pret ', '<p>Bonjour / bonsoir Mme et Mr Particulier vous vous &ecirc;tes malheureusement vue refus&eacute; des cr&eacute;dit au pr&egrave;s des banques pour causes diverses . Vous &ecirc;tes particulier , honn&ecirc;te et de bonne moralit&eacute; . Vous disposez d''un revenu pouvant vous permettre de survenir &agrave; vos mensualit&eacute;s; Plus de soucis je suis un particulier disposant d''un capital bien &eacute;lev&eacute; et que je d&eacute;sire mettre &agrave; votre disposition sous forme de pr&ecirc;t remboursable sur une dur&eacute;e maximale de 25 ans je vous offre de pr&ecirc;t de 1.000&euro; &agrave; 80.000.000&euro; &agrave; toutes personnes capable de le rembourser avec int&eacute;r&ecirc;t &agrave; un taux allant de deux &agrave; trois pour cent 2% &agrave; 3% selon la somme demand&eacute;e et la dur&eacute;e de remboursement. Alors si Vous avez besoin de faire un pr&ecirc;t . NB:S''abstenir si vous n''&ecirc;tes pas s&eacute;rieux sous peine de poursuite judiciaire Merci de me contacter par<br />Email : leboiskevin@gmail.com</p>', 31, 10, '2014-09-10 14:47:29', 'upload/8202/Dollar.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
