(8213, 208, 'Offre de prêt entre particulier sérieux ', '<p><strong>plus de soucis pour vous maintenant car je suis l&agrave; pour vous</strong> <br />aider.Savez vous que beaucoup de personne dans <br />le monde veulent r&eacute;aliser beaucoup de projet pouvant cr&eacute;er des <br />milliers d''emplois? mais n''ont pas de moyen financier pour <br />d&eacute;buter leur projet. Je pense vous aider avec un financement rapide <br />et fiable.Je dispose d''un capital qui servira &agrave; octroyer des pr&ecirc;ts <br />particulier &agrave; court et long terme allant de 5000 &agrave; 2.000.000&euro; &agrave; toute <br />personne s&eacute;rieuse voulant de ce pr&ecirc;t. 1.5% <br />d''int&eacute;r&ecirc;t l''an selon la somme pr&ecirc;t&eacute; car &eacute;tant particulier je ne veux pas <br />violer la loi sur l''usure. Vous pouvez rembourser sur 6 &agrave; 20 ans <br />maximum selon la somme pr&ecirc;t&eacute;. c''est &agrave; vous de voir pour les <br />mensualit&eacute;s. Je ne demande qu''une <br />reconnaissance de dette certifi&eacute;e manuscrite et aussi quelques <br />pi&egrave;ces &agrave; fournis <br />Contactez- nous uniquement par mail : gaieanne-marie@outlook.fr</p>', 31, 0, '2014-10-31 14:32:25', 'upload/8213/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
