(8216, 137, 'Octroi de prêt entre particulier honnête', '<p>Bonsoir Mme et Mr<br />Moi je suis Mr Nicolas DUPONT. Je suis de nationalit&eacute; fran&ccedil;aise, ma capacit&eacute; de pr&ecirc;ter va jusqu&rsquo;&agrave; 1.000 000 &euro; par particulier. Vu les nombreuses arnaques qui existe aujourd&rsquo;hui dans le pr&ecirc;t entre particulier, je vous informe que beaucoup de pr&eacute;cautions ont &eacute;t&eacute; prise afin d&rsquo;assurer et garantie les personnes qui font les demandes de pr&ecirc;t.Mon taux d&rsquo;int&eacute;r&ecirc;t est unique et il est non n&eacute;gociable, fix&eacute; &agrave; 2% sur la valeur total demand&eacute;. J&rsquo;aimerais aussi vous demander de faire tr&egrave;s attention aux offres venant d&rsquo;Afrique (C&ocirc;te d&rsquo;Ivoire, B&eacute;nin et autres&hellip;), car presque toutes les personnes avec qui j&rsquo;entre en contact ont d&eacute;j&agrave; &eacute;t&eacute; victime d&rsquo;arnaque.Ces arnaques ont tellement pris de l&rsquo;ampleur &agrave; tel point que m&ecirc;me les cha&icirc;nes de t&eacute;l&eacute;vision en parlent (M6, et autre cha&icirc;ne d&rsquo;Afrique)Mon offre est s&eacute;rieuse, vous pourriez vous en rendre compte &agrave; travers la proc&eacute;dure qui est la proc&eacute;dure l&eacute;gale d&rsquo;octroi de pr&ecirc;t entre particulier.De gr&acirc;ce j&rsquo;aimerais &ecirc;tre contact&eacute; par des personnes s&eacute;rieuses, &eacute;tant en mesure de rembourser les pr&ecirc;ts. Les remboursements d&eacute;butent 3 mois apr&egrave;s que les fonds soit vir&eacute;.Si vous &ecirc;tes int&eacute;ress&eacute;, alors n&rsquo;h&eacute;sitez &agrave; me contacter sur mon mail qui est: nicolasdupont900@gmail.com</p><br />\r\n<p>&nbsp;</p><br />\r\n<p><br /><br /></p>', 31, 5, '2014-11-16 17:24:40', 'upload/8216/206994emprunt.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8217, 211, 'offre de pret entre particulier sérieux ', 'Ce message s''adresse aux particuliers , ou &agrave; tous ceux qui sont dans le besoin d''un pr&ecirc;t particulier pour reconstruire leur vie .<br />vous &ecirc;tes &agrave; la recherche de pr&ecirc;t pour soit relancer vos activit&eacute;s soit pour la r&eacute;alisation d''un projet ,soit pour vous acheter un appartement mais vous &ecirc;tes interdit bancaire ou votre dossier &agrave; &eacute;t&eacute; rejett&eacute; &agrave; la banque.<br />Je suis une particuli&egrave;re j&rsquo;octroie des pr&ecirc;ts allant de 1.000 &agrave; 500.000 &euro; &agrave; toutes personnes capable de respecter les conditions . Mon taux d&rsquo;int&eacute;r&ecirc;t est de 2% l''an.<br />Si vous avez besoin d''argent pour d''autres raisons , n&rsquo;h&eacute;sitez pas &agrave; me contacter pour plus d''informations. particuliers s&eacute;rieux et honn&ecirc;tes. merci de me contacte par<br /><br />E-mail: paulus.david00@gmail.com', 31, 0, '2014-12-04 12:26:16', 'upload/8217/euros.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8218, 155, ' Pret entre particulier sérieux et honnê', '<p><br />Bonjour</p><br />\r\n<p>Vous &ecirc;tes un particulier, &agrave; la recherche d&rsquo;un pr&ecirc;t avec le TEG annuel fixe : 2 % sur la somme &agrave; emprunter J&rsquo;offre &agrave; toutes personnes des pr&ecirc;ts allant de 1000 &agrave; 10.000.000&euro; pour la mise en place de vos projets ou pour consolider vos dettes. Je suis dispos&eacute; &agrave; accompagner toute personne s&eacute;rieuse, honn&ecirc;te, dans la r&eacute;alisation de ses projets dans un cadre de collaboration clair et bien d&eacute;fini qui arrange le pr&ecirc;teur et l&rsquo;emprunteur.J''ai besoin de votre r&eacute;ponse urgente si vous &ecirc;tes int&eacute;ress&eacute;.Veuillez me contacter par mail.</p>', 32, 1, '2014-12-12 05:25:21', 'upload/8218/euy.jpg;upload/8218/euy.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
