(8220, 213, 'offre de prêt d(argent', '<p>Je mets &agrave; votre disposition un pr&ecirc;t &agrave; partir de 5000&euro; a 185.000&euro; &agrave; des conditions<br />tr&egrave;s simple. Je fais aussi des investissements et des pr&ecirc;ts entre particulier de<br />toutes sortes .J''offre des cr&eacute;dits &agrave; court, moyen et long terme en collaboration<br />avec mon avocat. Nous ignorons de vos usages et nos transferts sont assur&eacute;s par<br />une banque pour la s&eacute;curit&eacute; de la transaction. Pour toutes vos demandes faites <br />propositions par rapport aux taux et aux &eacute;chelonnements de paiements et je serai<br />&agrave; votre aide. Enfin pour plus de compr&eacute;hension veuillez me joindre par mail:</p>', 31, 0, '2014-12-13 20:59:27', 'upload/8220/3000.jpg;upload/8220/1023.jpg;upload/8220/321.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8221, 214, 'Offre de prêt entre particulier', 'Solution pour R&eacute;soudre tout ces probl&egrave;mes financi&egrave;res <br /><br />Vous souhaitez b&eacute;n&eacute;ficier d''un cr&eacute;dit pour la mise en <br />&oelig;uvre de vos projets, Vous souhaitez b&eacute;n&eacute;ficier d''un fond <br />de commerce, vous souhaitez b&eacute;n&eacute;ficier d''un cr&eacute;dit pour le <br />progr&egrave;s de vos Etudes, Vous souhaitez changer de voiture, <br />vous &eacute;quiper en &eacute;lectrom&eacute;nager, vous offrir une nouvelle maison. <br />Malheureusement il se trouve que vous &ecirc;tes au ch&ocirc;mage, &eacute;l&egrave;ve ou <br />&eacute;tudiant, personne pour vous servir d''aval, Vous &ecirc;tes sans emploi <br />ou fich&eacute; en Banque ou vous fa&icirc;tes objet d''interdit bancaire pour <br />incident non ind&eacute;pendant de votre volont&eacute;, de ce fait aucune institution <br />financi&egrave;re n''accepte de vous faire de pr&ecirc;t. Vous avez cependant Besoin de <br />financer le projet dont vous r&ecirc;vez et qui vous tient a c&oelig;ur ou vous voulez <br />bien f&ecirc;tez plus de soucis ; cela ne devrait plus vous poser de probl&egrave;me <br />Profitez en maintenant<br />Contacte<br />Mail : bonnet_joseph@yahoo.fr<br />Site web :http://solutionfinanciere.e-monsite.com<br /><br /><br />http://solutionfinanciere.e-monsite.com', 31, 500, '2014-12-20 18:39:24', 'upload/8221/1.jpg;', 'off', 'on', 'refusee', 'off', 'on'),
(8222, 215, 'Aide financière à toute personne honnête', '<br />Bonjour Mr/Mme, Obtenir un pr&ecirc;t l&eacute;gitimes a toujours &eacute;t&eacute; un gros<br />probl&egrave;me pour vous. La question du cr&eacute;dit et de la s&eacute;curit&eacute; est<br />quelque chose que les clients sont de plus en plus pr&eacute;occup&eacute;s par la<br />recherche d''un pr&ecirc;t d''un pr&ecirc;teur l&eacute;gitimes. Le taux d''int&eacute;r&ecirc;t pour mon<br />pr&ecirc;t est de 2% et le montant minimum que je donne sous forme de pr&ecirc;t<br />est de 1000 &euro; pour laquelle le montant maximum est de 500.000 &euro;. Si vous<br />&ecirc;tes int&eacute;ress&eacute;s &agrave; obtenir une aide financi&egrave;re,<br />Voici mon adresse mail: philippepahon@hotmail.com', 31, 1, '2015-01-04 16:07:36', 'upload/8222/dfdfdf.jpeg;', 'off', 'off', 'refusee', 'off', 'off'),
(8223, 216, ' Accord de prêt entre particuliers', '<br />Pas de preuve requis pour venir en soutien &agrave; toutes les personnes en situation difficile, Cette vision pluraliste et internationale de l''investissement nous a conduit vers un nouveau type d''investissement <br /><br />qui est le PR&Ecirc;T.En effet, j''offre mes services &agrave; des particuliers honn&ecirc;tes qui sont dans le besoin d''un soutien financier pour la cr&eacute;ation d''entreprise soit lucrative ou pour s''assurer d''un lendemain <br /><br />meilleur avec un taux d''int&eacute;r&ecirc;t estim&eacute; &agrave; 3%. Mon groupe et moi disposons d''un capital d''environ 7.500.000 &euro; et sommes dispos&eacute; &agrave; vous accorder un pr&ecirc;t compris entre 3.000 &euro; et plus de 5000.000 <br /><br />&euro;.Je pr&ecirc;te &agrave; toutes les personnes honn&ecirc;tes et s&eacute;rieux en mesure de me rembourser dans un d&eacute;lai raisonnable. Si vous &ecirc;tes donc int&eacute;ress&eacute; par nos services il vous suffira de nous faire part de votre <br /><br />demande en nous pr&eacute;cisant le montant que vous souhaiteriez emprunter et la dur&eacute;e sur laquelle s''&eacute;tendra son remboursement. Vous &ecirc;tes interdits bancaires et vous n''avez pas la faveur des banques ou <br /><br />vous avez besoin d''argent pour payer des factures ou mieux encore vous avez un plan et le financement n''h&eacute;siter pas &agrave; me contacter &agrave; l''adresse e-mail ci-dessous:&nbsp; Pierreleiby78@gmail.com<br />Nous sommes &agrave; votre service 24/24', 9, 11, '2015-01-13 16:30:23', 'upload/8223/1012137-1379011982379189-623148319-n.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8224, 216, '  Accord de prêt entre particuliers ', '<br />Pas de preuve requis pour venir en soutien &agrave; toutes les personnes en situation difficile, Cette vision pluraliste et internationale de l''investissement nous a conduit vers un nouveau type d''investissement qui est le PR&Ecirc;T.En effet, j''offre mes services &agrave; des particuliers honn&ecirc;tes qui sont dans le besoin d''un soutien financier pour la cr&eacute;ation d''entreprise soit lucrative ou pour s''assurer d''un lendemain meilleur avec un taux d''int&eacute;r&ecirc;t estim&eacute; &agrave; 3%. Mon groupe et moi disposons d''un capital d''environ 7.500.000 &euro; et sommes dispos&eacute; &agrave; vous accorder un pr&ecirc;t compris entre 3.000 &euro; et plus de 5000.000 &euro;.Je pr&ecirc;te &agrave; toutes les personnes honn&ecirc;tes et s&eacute;rieux en mesure de me rembourser dans un d&eacute;lai raisonnable. Si vous &ecirc;tes donc int&eacute;ress&eacute; par nos services il vous suffira de nous faire part de votre demande en nous pr&eacute;cisant le montant que vous souhaiteriez emprunter et la dur&eacute;e sur laquelle s''&eacute;tendra son remboursement. Vous &ecirc;tes interdits bancaires et vous n''avez pas la faveur des banques ou vous avez besoin d''argent pour payer des factures ou mieux encore vous avez un plan et le financement n''h&eacute;siter pas &agrave; me contacter &agrave; l''adresse e-mail ci-dessous:&nbsp; Pierreleiby78@gmail.com<br />Nous sommes &agrave; votre service 24/24<br /><br />', 10, 11, '2015-01-13 16:31:29', 'upload/8224/OFFRE-DE-PRET.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8225, 217, 'offre de prêt et financement sérieux', '<p>Bonsoir Madame et monsieur,<br />Avez-vous &eacute;t&eacute; rejet&eacute;(e) par de nombreuses banques ? vous &ecirc;tes en<br />Fichage bancaire ou sortir du Sur-endettement ?<br />Avez-vous besoin de financements pour la consolidation de votre dette ?<br />Avez-vous besoin de pr&ecirc;t pour aider votre entreprise &agrave; se remettre sur<br />les rails ou autres besoins? votre solution c''est nous.<br />Nous sommes une soci&eacute;t&eacute; de pr&ecirc;t de capitaux et nous offrons des pr&ecirc;ts<br />aux clients int&eacute;ress&eacute;s &agrave; faible<br />taux d''int&eacute;r&ecirc;t. Nous octroyons que des pr&ecirc;ts entre particuliers<br />variant de ; 2.000 &euro; a 750.000 &euro; avec un taux d''int&eacute;r&ecirc;t<br />nominal de 2% quel que soit le montant. Si vous &ecirc;tes int&eacute;ress&eacute;<br />contactez-nous par e-mail suivants: <a href="mailto:financeinvestissement001@gmail.com">financeinvestissement001@gmail.com<br /><br /></a></p>', 31, 10, '2015-01-16 23:38:56', 'upload/8225/4448-1.jpg;upload/8225/150779-100480680151200-332037942-n.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8226, 219, ' Vous avez des difficultés financières?', '<p>Vous avez des difficult&eacute;s &agrave; obtenir de financement? Consolez-vous, vous n''&ecirc;tes pas les seuls! Tout va tellement vite aujourd''hui, la pression est forte et il est facile de faire des erreurs de parcours. Face &agrave; une situation difficile si vous avez une claire volont&eacute; de surmonter la pente vous pouvez obtenir une deuxi&egrave;me chance de cr&eacute;dit entre particuliers s&eacute;rieux. Les banques ou les institutions financi&egrave;re vous demanderont trop de garanties comme preuve &eacute;vidente de votre solvabilit&eacute;.<br />Je suis un particulier, qui est en mesure de vous aider si toutefois vous disposez d&rsquo;une source de revenu mensuel.<br />Pour plus d''infos,veuillez bien me contacter:</p><br />\r\n<p>Voici mon adresse email: <strong>renaudclaudes@hotmail.com</strong></p><br />\r\n<p>Merci de faire tourner &ccedil;a peut &eacute;ventuellement int&eacute;resser vos amis !</p>', 31, 1, '2015-01-23 08:27:07', 'upload/8226/641725.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8227, 219, 'Offre de prêt entre particulier ', 'Bonsoir Mme et Mr vous avez besoin de pr&ecirc;t pour votre maison, pour votre Soci&eacute;t&eacute;, pour l&rsquo;achat de voiture, pour cr&eacute;er votre propre entreprise, pour de dettes famili&egrave;re ou pour cr&eacute;er un restaurant soit une h&ocirc;tel, ou pour faire face aux difficult&eacute;s financi&egrave;res pour enfin sortir de l&rsquo;impasse que provoquent les banques, par le rejet de vos dossiers de demande de cr&eacute;dits ? Nous sommes en mesure de vous faire des pr&ecirc;ts au montant dont vous avez besoin &agrave; partir de 5. 000 euro jusqu''au montant que vous souhaitez &agrave; un taux int&ecirc;ret de 2% et avec des conditions qui vous faciliteront la vie. Vous avez des interdits bancaires et vous n&rsquo;avez pas la faveur des banques ou mieux vous avez un projet et besoin de financement. Contacter nous par mail pour plus d&rsquo;informations.', 35, 3, '2015-01-23 08:33:41', 'upload/8227/500-Euro-Banknoten-Copie.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8228, 219, 'Offre de prêt ', '<p>Bonjour &agrave; tous. Je suis un pr&ecirc;teur priv&eacute;, donc je mets &agrave; la disposition des pauvres un fond pouvant les aider &agrave; r&eacute;aliser leurs r&ecirc;ves afin de mettre fin a leurs souffrances. Nous mettons &eacute;galement ce fond a la disposition de toutes personnes cherchant d&rsquo;investissement pour r&eacute;aliser ses projets d''entreprises et autres. Notre taux d''int&eacute;r&ecirc;t est de 2% Partout dans le monde. Nous sommes une soci&eacute;t&eacute; de pr&ecirc;t enregistr&eacute; et religieux et nous avons &eacute;t&eacute; dans les pratiques pendant longtemps, nous donnons des pr&ecirc;ts pour aider les personnes, les entreprises qui ont besoin de mettre &agrave; jour leur situation financi&egrave;re. <br />* &Ecirc;tes-vous press&eacute; financi&egrave;rement ? * Avez-vous chercher des fonds pour rembourser les cr&eacute;dits et dettes* Avez-vous rechercher des financements pour mettre en place votre propre entreprise ? * Avez-vous besoin de pr&ecirc;ts priv&eacute;s ou professionnels &agrave; des fins diverses ? * Cherchez-vous pr&ecirc;ts pour mener &agrave; bien de grands projets* Vous cherchez le financement de divers autres processus ?<br />Veuillez me contacter pour tous autres renseignements.<br />cordialement</p>', 30, 2, '2015-01-23 08:44:10', 'upload/8228/72690-euro-bills-p-Copie.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8229, 219, ' financement sérieux et rapide', '<p>Vous qui avez besoin de financement urgent, vous<br />qui &ecirc;tes souvent rejeter par les banques, vous avez besoin d''un pr&ecirc;t<br />d''argent pour r&eacute;gler vos dettes ou r&eacute;aliser vos projets, nous faisons<br />des pr&ecirc;t de 5000 Euro &agrave; 10.000 000 Euro veuillez nous adresser directement<br />votre demande de cr&eacute;dit et vous le recevrez par virement bancaire en<br />une dur&eacute;e de 72 heures sans protocole avec un taux d''int&eacute;r&ecirc;t de 2% par<br />an. Veuillez bien nous contacter pour plus d''informations.<br />cordialement</p>', 32, 2, '2015-01-23 09:03:06', 'upload/8229/depositphotos-3187013-Businessman-with-a-euro-symbol.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8230, 220, 'Offre de prêt entre particulier au taux ', '<p>Bonjour Particulier je vous offre de pr&ecirc;t de 2000 EURO &agrave; 1.000.000 EURO &agrave;<br />toute personne capable de le rembourser avec int&eacute;r&ecirc;t a un taux faible<br />de 3%.Nous sommes des particuliers qui offre de pr&ecirc;t entre<br />Particuliers s&eacute;rieux qui ont besoin pour les petits entreprises, Nous<br />faisons des pr&ecirc;ts locaux et des pr&ecirc;ts internationaux &agrave; des personnes<br />partout dans le monde. Nous ne n&eacute;cessitons pas beaucoup de documents.<br />Pr&ecirc;t juste et honn&ecirc;te et fiable. Contactez-nous d&egrave;s aujourd''hui.</p>', 33, 0, '2015-02-04 18:45:51', 'upload/8230/1911697-527779733985992-1735953500-n.jpg;upload/8230/images.jpg;upload/8230/Aide-financiere-d-argent-rapide-et-fiable-a-vous-tous-article.jpg;', 'on', 'on', 'refusee', 'on', 'off'),
