(8265, 242, 'Offre de prêt rapide aux personnes ', '<p>Vous &ecirc;tes fich&eacute; interdit bancaire et vous n''avez pas la faveur des banques, ou mieux vous avez un projet et besoin de financement, un mauvais dossier de cr&eacute;dit ou besoin d''argent pour payer des factures, fonds &agrave; investir sur les entreprises. Je dispose d''un capital qui servira &agrave; octroyer des pr&ecirc;ts particulier &agrave; court et long terme allant de 3000&euro; &agrave; 3. 000. 000&euro; &agrave; toute personne s&eacute;rieuse voulant de ce pr&ecirc;t. 3% d''int&eacute;r&ecirc;t l''an selon la somme pr&ecirc;t&eacute; car &eacute;tant particulier je ne veux pas violer la loi sur l''usure. Contactez moi pour savoir les d&eacute;marches &agrave; suivre.<br />Merci de me contact&eacute; directement sur mon adresse mail qui suit: jennifer.vitry@gmail.com</p><br />\r\n<p>&nbsp;</p>', 35, 1, '2015-05-14 12:02:06', '', 'off', 'off', 'refusee', 'off', 'on'),
(8266, 243, 'Offre Prêt Rapide Sûr Et Fiable Pour Vos', '<br /><br /><br />Vous &ecirc;tes &agrave; la recherche d''un cr&eacute;dit,pr&ecirc;t ( Consommation , r&eacute;novation , immobilier , affaire etc..)<br />Nous vous apportons le financement n&eacute;cessaire dont vous avez besoin &agrave; un taux concurrentiel de 2,20%<br />l''an avec un accord de principe sous 48h certifier avec un contrat notari&eacute; &agrave; la cl&eacute;.<br />Veuillez me contacter directement par Email : &nbsp;&nbsp; &nbsp;<br />Tout documents bancaires seront &agrave; votre disponibilit&eacute; une fois le virement effectu&eacute;.<br />Certificat de d&eacute;p&ocirc;t banque Certificat de fonds Attestation d''assurance etc..<br />PS : Sachez que la transaction ce passe en France ou en Belgique Cordialement...<br /><br />', 31, 10, '2015-05-18 12:17:05', 'upload/8266/20000.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8267, 243, 'Offre de prêt d''argents crédible rapide ', '<br />Vous souhaitez b&eacute;n&eacute;ficier d&rsquo;un cr&eacute;dit pour la mise en &oelig;uvre de vos projets, Vous souhaitez b&eacute;n&eacute;ficier d&rsquo;un fond de commerce.<br />Je suis Mr ERIC BERRUYER particulier experts financiers en mesure de vous faire un pr&ecirc;t au montant dont vous avez besoin et avec des conditions tr&egrave;s simple qui vous faciliteront la vie. Si vous avez vraiment besoin de pr&ecirc;t, Veuillez me contacter directement par Email: <br />berruyereric12@gmail.com<br /><br />', 31, 10, '2015-05-18 12:19:14', 'upload/8267/20000.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8268, 243, 'Offre Prêt Rapide Sûr Et Fiable Dans 48h', '<br />Vous &ecirc;tes &agrave; la recherche d''un cr&eacute;dit,pr&ecirc;t ( Consommation , r&eacute;novation , immobilier , affaire etc..)<br />Nous vous apportons le financement n&eacute;cessaire dont vous avez besoin &agrave; un taux concurrentiel de 2,20%<br />l''an avec un accord de principe sous 48h certifier avec un contrat notari&eacute; &agrave; la cl&eacute;.<br />Veuillez me contacter directement par Email : &nbsp;&nbsp; &nbsp;<br />Tout documents bancaires seront &agrave; votre disponibilit&eacute; une fois le virement effectu&eacute;.<br />Certificat de d&eacute;p&ocirc;t banque Certificat de fonds Attestation d''assurance etc..<br />PS : Sachez que la transaction ce passe en France ou en Belgique Cordialement...<br /><br />', 30, 10, '2015-05-18 12:29:09', 'upload/8268/bbbbbbbbbbbbbbbbbbbbb.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8269, 244, ' Aider les gens qui sont dans le besoin ', 'Plus de 10 ann&eacute;es d''exp&eacute;rience pour une qualit&eacute; de service encore plus<br />grande. Je suis Melissa Robyn&nbsp; et J''offre aujourd''hui des pr&ecirc;ts &agrave;<br />toutes personnes qui sont dans le besoins sur un taux d''int&eacute;r&ecirc;t de 2%<br />l''an. Je suis tr&egrave;s honn&ecirc;te, et fiable. Contactez-moi d&egrave;s aujourd''hui<br />et faites moi savoir le montant d''argent que vous voulez pr&ecirc;ter. Je<br />suis dispos&eacute; &agrave; vous satisfaire en 72h. Notre groupe se trouvant en<br />FRANCE vous satisfera en &eacute;tudiant votre demande en peu de jours, sans<br />aucun protocole financier. Si vous &ecirc;tes int&eacute;ress&eacute;<br />n''h&eacute;sitez pas &agrave; me contacter directement sur: melissarobyn8@gmail.com', 31, 0, '2015-05-18 14:49:07', 'upload/8269/1.jpeg;', 'off', 'on', 'refusee', 'off', 'on'),
(8270, 1, 'Samsung Galaxy S6 blanc', '<p>Je vends mon samsung galaxy s6 blanc 32 go dans un &eacute;tat irr&eacute;prochable.<br />Il est vendu avec tous ses acc&eacute;ssoires, la boite, la facture, et meme 1 chargeur suppl&eacute;mentaire.<br />Biensur la garantie est toujours fonctionnelle.</p>', 11, 450, '2015-05-29 10:28:36', 'upload/8270/648535.jpg;', 'on', 'on', 'validee', 'off', 'on'),
(8271, 245, 'Sorcellerie/Magie/ Vodou/ Voyance ', '<br />Forte de mon initiation dans divers domaines &eacute;sot&eacute;riques, (telle que la sorcellerie noir , la magie indienne , &nbsp;<br />l''interpr&eacute;tation des r&ecirc;ves, la pri&egrave;re &eacute;sot&eacute;rique, DIPLOME EN SCIENCES OCCULTES, PRATICIEN DE LA HAUTE MAGIE, grand pr&ecirc;te vaudou), <br />&nbsp;j''ai d&eacute;cid&eacute; de mettre enfin &agrave; votre disposition mon savoir. J&rsquo;ai acquis une r&eacute;putation mondiale - pas de d&eacute;ception - <br />&nbsp;r&eacute;sultats 100% garantis je poss&egrave;de des dons surnaturels, maitrise&nbsp; toute force spirituelle,&nbsp; &nbsp;<br />je r&eacute;sous&nbsp; tous les probl&egrave;mes une fois pour tout, m&ecirc;me les cas les plus d&eacute;sesp&eacute;r&eacute;s : sp&eacute;cialiste du retour de l''&ecirc;tre aim&eacute; - envo&ucirc;tements - d&eacute;senvo&ucirc;tement - protection contre les mal&eacute;fices - protection contre les mauvais sorts&nbsp; - chance partout&nbsp; richesse-mal&eacute;fices,Argent, Amour, Chance, Richesse, Justice, Anti balle, gloire, vente, achat, commerce, affection, promotion sociale, d&eacute;senvoutement, amour, voyage, sortil&egrave;ge, Examen, Etudes etc. - r&eacute;sultats efficaces....Et une aide dans vos diverses d&eacute;marches et questions. En tant qu''initi&eacute;e, je saurais vous aider au mieux dans les divers probl&egrave;mes qui gangr&egrave;nent votre vie, qui vous &eacute;puisent.. Travail rapide et double efficacit&eacute;. Je fais le Pacte avec le diable, gr&acirc;ce a cela vous aurez tout ce que vous voulez en un laps de temps, tout est possible gr&acirc;ce &agrave; la magie. Protection/Amulette Anti-Balle/Anti-Poisson,Anti-poignard pour les policier et autres, gu&eacute;rit &eacute;galement des maladies&nbsp;&nbsp; incurable je mets mon savoir &agrave; la disposition des autres, afin de leur apporter soutien et soulagement, tout en continuant ma route <br />&nbsp;Contact: satisfac