(8294, 256, 'Témoignage suite à une aide financière d', '<p>Je ne croyais plus au pr&ecirc;t d''argent car toutes les banques rejetaient mon dossier; en effet j''&eacute;tais fich&eacute; par ma banque. Mais un jour une amie m''a conseill&eacute; un pr&ecirc;teur particulier dont elle m''a donn&eacute; l''e-mail. J''ai tent&eacute; le coup avec lui en lui adressant un mail puis &ccedil;a a march&eacute;. J''ai eu la bonne personne un honn&ecirc;te pr&ecirc;teur particulier que je cherchais depuis des ann&eacute;es. J''ai obtenu mon pr&ecirc;t qui me permet de bien vivre actuellement et je paye r&eacute;guli&egrave;rement mes mensualit&eacute;s. Vous pouvez le contacter si vous &ecirc;tes dans le besoin d''un pr&ecirc;t pour diverses raisons personnelles. Deux de mes coll&egrave;gues ont &eacute;galement re&ccedil;u des pr&ecirc;ts sans aucune difficult&eacute;. <br />Voici son E-mail: davidanthony2@outlook.com <br />Dites lui que vous venez de la part de Rivera Diane et vous aurez gain de cause &agrave; co&ucirc;t sure.</p>', 31, 0, '2015-07-05 23:33:13', 'upload/8294/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
