(8312, 263, 'investissement et offre de prêt entre pa', '<p>Vous &ecirc;tes fich&eacute;s, interdits bancaires et vous<br />n''avez pas la faveur des banques ou mieux vous avez un projet et besoin<br />de financement,un mauvais dossier de cr&eacute;dit ou besoin d''argent pour<br />payer des factures, fonds &agrave; investir sur les entreprises. Alors si vous<br />avez besoin de pr&ecirc;t d&rsquo;argent n''h&eacute;sitez pas &agrave; me contacter par<br />E-mail: pircone@hotmail.fr<br />pour en savoir plus sur mes conditions bien<br />favorable. Personne pas s&eacute;rieux s''abstenir<br />Merci</p>', 31, 10, '2015-07-30 04:14:15', 'upload/8312/Euro.jpg;', 'off', 'on', 'refusee', 'off', 'on'),
(8313, 264, 'offre de prêt de entre particulier', '<p>Vous avez besoin de pr&ecirc;ts pour faire face aux difficult&eacute;s financi&egrave;res pour enfin sortir de l&rsquo;impasse que provoquent les banques, par le rejet de vos dossiers de demande de cr&eacute;dits ? Nous sommes en mesure de vous faire des pr&ecirc;ts au montant dont vous avez besoin et avec des conditions qui vous faciliteront la vie. Voici les domaines dans lesquels nous pouvons vous aider:<br />* Pr&ecirc;t au m&eacute;nage<br />* Pr&ecirc;t immobilier<br />* Pr&ecirc;t &agrave; l&rsquo;investissement<br />* Pr&ecirc;t automobile<br />* Dette de consolidation<br />* Rachat de cr&eacute;dit<br />* Pr&ecirc;t personnel<br />Vous avez des interdits bancaires et vous n&rsquo;avez pas la faveur des banques ou mieux vous avez un projet et besoin de financement.<br />Contacter nous par mail pour plus d&rsquo;informations: barroux.lucie@outlook.fr</p><br />\r\n<p>NB: int&ecirc;ret 3%</p>', 31, 0, '2015-08-10 22:44:38', 'upload/8313/billets-euro-compte-1-0.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8314, 266, 'Offre de prêt entre particulier sérieux', '<br />Bonjour,<br />Vous avez besoin d''un pr&ecirc;t ? Vous &ecirc;tes rejet&eacute;s par les banques et <br />vous d&eacute;sirez avoir un pr&ecirc;t pour subvenir a vos besoins quelconques <br />? Quel que soit votre situation financi&egrave;re. Je vous accorde ma <br />prestation de service ( pr&ecirc;ts hypoth&eacute;caires, pr&ecirc;ts commerciaux, pr&ecirc;ts <br />internationaux, pr&ecirc;ts personnels , pr&ecirc;t immobilier, financement et <br />Pr&ecirc;ts &eacute;ducatifs ). Contacter moi si seulement si le besoin se fait <br />ressentir et b&eacute;n&eacute;ficiez de ma prestation de services financi&egrave;res. <br />Email : philippe.turpin1@outlook.fr<br />Mr Philippe TURPIN<br /><br /><br /><br id="tinymce" class="mceContentBody " />', 31, 1, '2015-08-14 06:57:32', 'upload/8314/pret.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8321, 268, 'Prêt entre 5.000€ à 22.000€', '<p>Bonjour Mr.<br />Je suis une particulier et je dispose d''une capacit&eacute; de 1.000.000&euro; pour mes clients. contacter moi par mon t&eacute;l&eacute;phone: 0645123698<br />alors veuillez me contacter sans doute.<br />Merci.</p><br />\r\n<p>&nbsp;</p><br />\r\n<p>&nbsp;</p>', 30, 55, '2015-09-02 13:56:18', 'upload/8321/11.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8322, 268, '1.0000€', '<p>Bonjour Monsieur et mesdames,<br />nous sommes un groupe de particuliere bas&eacute; en france Pour tout votre besoin de pr&ecirc;ts entre particuliers,<br />pour faire face &agrave; vos difficult&eacute;s Financi&egrave;res<br />et sortir de l''impasse que provoquent les banques par le rejet de vos Dossiers<br />de demande de cr&eacute;dits. Nous sommes en mesure de vous accorder des pr&ecirc;ts<br />selon le montant dont vous avez besoin et Avec des conditions qui vous faciliteront la vie.<br />Nous proposons des cr&eacute;dits &agrave; court et &agrave; long terme avec une dur&eacute;e de remboursement tr&egrave;s Abordable, nos accords de cr&eacute;dits commencent &agrave; partir de 5000 jusqu''&agrave; 1 000 000 euro.<br />Nos services sont les suivants :</p><br />\r\n<br /><br />\r\n<p>* Financier<br />* Pr&ecirc;t immobilier<br />* Pr&ecirc;t &agrave; l''investissement<br />* Pr&ecirc;t automobile<br />* Dette et consolidation<br />* Marge de cr&eacute;dit<br />* Deuxi&egrave;me hypoth&egrave;que<br />* Rachat de cr&eacute;dit<br />* Pr&ecirc;t personnel</p><br />\r\n<br /><br />\r\n<p><br />Aussi nous voudrions vous dire que nous intervenons &eacute;galement dans le financement<br />des projets (Fiables).<br />Vous &ecirc;tes fich&eacute;s, interdits bancaires et vous n''avez pas la faveur des banques<br />ou mieux Vous avez un projet et besoin de financement,<br />un mauvais dossier de cr&eacute;dit ou besoin Argent pour payer des factures,<br />fonds &agrave; investir sur les entreprises.<br />Alors n''h&eacute;sitez pas &agrave; nous contacter &agrave; l''adresse suivante: projet-finance@hotmail.com</p><br />\r\n<br /><br />\r\n<p>NB:vous n''avez aucun frais a payer avant de recevoir votre pret</p><br />\r\n<br /><br />\r\n<p>recevez nos salutations</p>', 1, 55, '2015-09-03 11:05:37', 'upload/8322/0101010.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8323, 269, 'TÉMOIGNAGE D''OFFRE DE PRÊT ENTRE PARTICU', '<p>Si j''ai retrouv&eacute;e le sourire c''est gr&acirc;ce<br />&agrave; Mr RICHARD SIMENTIER qui m''a octroy&eacute; un pr&ecirc;t de 50.000&euro; et deux de mes coll&egrave;gues ont &eacute;galement re&ccedil;u des pr&ecirc;ts de<br />cet Mr sans aucunes difficult&eacute;s avec un taux de 2%<br />par An. Je vous conseille de ne plus vous trompez de<br />personne si vous voulez effectivement faire une demande<br />de pr&ecirc;t d&rsquo;argent pour votre projet et tout autre. Je publie<br />ce message parce que Mr RICHARD m&rsquo;a fait du bien avec<br />ce pr&ecirc;t.C''est par le biais d''une amie que j''ai rencontr&eacute; Mr RICHARD Simentier, honn&ecirc;te et g&eacute;n&eacute;reux qui m&rsquo;a permis d&rsquo;obtenir ce pr&ecirc;t.Vous &ecirc;tes fich&eacute; interdit bancaire et vous n''avez pas la faveur des banques, ou mieux vous avez un projet et besoin de financement, un mauvais dossier de cr&eacute;dit ou besoin d''argent pour payer des factures, fonds &agrave; investir sur les entreprises<br />Alors je vous conseille de le contacter et il vous satisfera pour tous les<br />services que vous lui demanderez. voici son courrier &eacute;lectronique:<br />richard.simentier@Outlook.fr<br />NB: plaisantins s''abstenir</p>', 31, 0, '2015-10-08 17:25:11', 'upload/8323/-.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8324, 270, 'J''offre de crédit entre particuliers rap', 'Bonjour a tous Vous &ecirc;tes &agrave; la recherche d&rsquo;un pr&ecirc;t pour la mise en place de vos projets ou pour consolider vos dettes. Vous avez besoin d&rsquo;un fonds de financement pour la r&eacute;alisation de vos projets.Vous &ecirc;tes un &eacute;l&egrave;ve, un &eacute;tudiant ou vous &ecirc;tes en ch&ocirc;mage. Avez-vous re&ccedil;u une interdiction bancaire et pour cela, les banques n&rsquo;acceptent plus de vous faire de pr&ecirc;t.Moi je tiens &agrave; vous dire que je suis disponible pour vous aider dans vos probl&egrave;mes de demande de pr&ecirc;t. Si vous avez besoin d&rsquo;un pr&ecirc;t, n&rsquo;h&eacute;sit&egrave; pas &agrave; me contacter pour plus d&rsquo;information sur mon offre. Contacte; k.philippe919@gmail.com <br /><br /><br />', 31, 1000, '2015-10-09 01:33:55', 'upload/8324/11.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
