(8337, 274, ' Obtenez vos prêts d''argents sans aucun ', '<p>Bonjour Monsieur et Madame</p><br />\r\n<p>Je dispose d''un capital qui servira &agrave; octroyer des pr&ecirc;ts particulier &agrave; court et long terme allant de 7000&euro; &agrave; 500.000&euro; &agrave; toute personne s&eacute;rieuse voulant de ce pr&ecirc;t. 2% &agrave; 3% d''int&eacute;r&ecirc;t l''an selon la somme. Email : dumoulin.guillaume@outlook.fr</p>', 31, 1, '2015-10-21 10:30:28', 'upload/8337/25236-123.jpg.thb.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8338, 275, 'Offre de prêt entre particuliers', 'Bonsoir <br />Vous &ecirc;tre fichi&eacute;, interdit bancaire et vous n''aviez par la faveur des banques, ou mieux vous aviez un projet, contacter moi pour plus d''information email: jeanpaolo32@gmail.com', 31, 500000, '2015-10-22 21:01:11', 'upload/8338/dddddddd.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
(8339, 276, 'Spéciale Offre De Prêts Pour Vos Projets', 'Vous &ecirc;tes Particuliers ; Fich&eacute;s ou Interdit Bancaire ; au ch&ocirc;mage ; au RSA ; totalement en situation de surendettement et souhaitez simplifier la gestion de votre budget en vous faisant racheter un ou plusieurs cr&eacute;dits que vous d&eacute;tenez dans d&rsquo;autres &eacute;tablissements urgent pour redresser vos finances .Vous recherchez un Pr&ecirc;t en toute urgence pour sortir de l''impasse que provoque les Banques, par le rejet de vos dossiers de demande . Vous souhaitez b&eacute;n&eacute;ficier d&rsquo;un cr&eacute;dit pour la mise en &oelig;uvre de vos projets...Nous disposons d''un capital consid&eacute;rable pouvant octroyer de : 2500&euro;...&agrave; 7.500.000 &euro; &agrave; toutes personnes &eacute;tant dans le besoin et dans les brefs d&eacute;lai . Quant aux taux d&rsquo;int&eacute;r&ecirc;t il est compris entre 1,4% &agrave; 5% selon le montant voulu .Merci de nous contacter pour amples renseignements : ( credit.epargne.mutuel@gmail.com)<br /><br />', 31, 5000, '2015-10-27 20:31:11', 'upload/8339/Pr-t1.jpg;', 'off', 'off', 'refusee', 'off', 'off'),
(8340, 206, 'Offre de prêt a taux 1.2%  et très urgen', '<br />Vous &ecirc;tes un homme ou une femme d&rsquo;affaires?<br />Si vous avez-des soucis de gestions financiers ou si vous n&rsquo;avez pas les <br />fonds n&eacute;cessaires pour d&eacute;marrer votre propre entreprise?<br />Si vous avez-besoin d\\''un pr&ecirc;t pour r&eacute;gler des dettes ou payer vos <br />factures? Vous avez un faible pointage de cr&eacute;dit et si vous r&eacute;gler des <br />dettes ou &agrave; payer vos factures?<br />Vous avez des probl&egrave;mes de cr&eacute;dit et vous trouvez qu\\''il est difficile <br />d&rsquo;obtenir des pr&ecirc;ts dans des banques ou d\\''autres institutions financi&egrave;res?<br />Si vous avez-vous besoin d\\''un pr&ecirc;t pour financer vos projets ?<br />Nous pouvons vous proposer un prix entre 5000&euro; et 500.000&euro; &agrave; un taux r&eacute;duit <br />&agrave; 1,2%<br />Ps : Pas s&eacute;rieux s\\''abstenir parce que je v&eacute;rifie tous les documents &agrave; la <br />pr&eacute;fecture .linevenault@hotmail.com', 31, 2, '2015-10-30 10:52:24', 'upload/8340/gdgg.jpg;upload/8340/dfg.jpg;', 'off', 'on', 'refusee', 'off', 'on'),
(8341, 277, 'financement de projets', 'Groupe d''investisseur priv&eacute; affili&eacute; &agrave; une structure de financement sommes dispos&eacute; &agrave; vous accompagner dans le financement de vos projets sous forme de pret rembourssable de minimum 500 000&euro; &agrave; un taux d''int&eacute;ret 3%, je vous informe que rien ne se fera &agrave; distance donc une rencontre tete &agrave; tete s''impose pour la signature du contrat et formalit&eacute;s &agrave; remplir en pr&eacute;sence du notaire et &agrave; la banque en europe. MERCI', 31, 100, '2015-11-05 13:51:57', 'upload/8341/images.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
