(8393, 297, ' Bonjour Faite attention aux escros sur ', '<p>Bonjour<br />Faite attention aux escros sur le internet .<br />vous &ecirc;tes a la recherche de pr&ecirc;t pour soit relancer vos activit&eacute;s soit pour la r&eacute;alisation d''un projet , soit pour vous acheter un appartement mais <br />h&eacute;las la banque vous pose a des conditions dont vous &ecirc;tes incapable moi je suis un particulier j&rsquo;octroie des pr&ecirc;ts allant de 2000&euro; &agrave; 1.500 000&euro; <br />&agrave; toutes personnes capable de respecter mes conditions ses ailleurs le taux d&rsquo;int&eacute;r&ecirc;t est de 2,20% l''an. soit vous avez besoin d''argent pour <br />d''autres raisons ; Veuillez me contacter pour plus d''informations. merci de me contacter pas mail: preteurchristopheloyal@gmail.com</p>', 31, 2, '2016-01-11 20:37:22', 'upload/8393/.9.jpg;', 'off', 'off', 'refusee', 'off', 'on'),
