(8395, 298, 'offre de prêt entre particulier honnête', '<p>Bonjour,<br /> <br /> Je suis Madame Nathalie CARAVELLA, femme d''affaire d''origine Fran&ccedil;aise et r&eacute;sidant en France.<br /> <br /> Dans le but de lutter contre la pauvret&eacute; et l&rsquo;exclusion bancaire, je vous propose en ligne :<br /> <br /> -Des Pr&ecirc;ts commerciaux<br /> -Des Pr&ecirc;ts personnels<br /> -Des Pr&ecirc;ts de financement<br /> -Des Pr&ecirc;ts immobilier<br /> <br /> Et tout allant de 1.000 euros &agrave; 500.000 euros.<br /> <br /> Le taux d&rsquo;int&eacute;r&ecirc;t des cr&eacute;dits est de 2,20 % sur l''ensemble du pr&ecirc;t et les conditions d''offre de pr&ecirc;t sont tr&egrave;s simples. Les pr&ecirc;ts demand&eacute;s sont obtenus dans un d&eacute;lai de 72 heures apr&egrave;s le d&eacute;p&ocirc;t des dossiers.<br /> <br /> Mon offre est s&eacute;rieuse, vous pourrez vous en rendre compte &agrave; travers la proc&eacute;dure qui est la proc&eacute;dure l&eacute;gale d&rsquo;octroi de pr&ecirc;t entre particulier.<br /> <br /> Contactez-moi d&egrave;s aujourd&rsquo;hui et faites-moi conna&icirc;tre le montant d&rsquo;argent que vous voulez emprunter.<br /> <br /> Mon adresse e-mail est la suivante: pret.urgent_accord001@yahoo.fr<br /> <br /> Au plaisir de vous lire</p>', 31, 12, '2016-01-12 17:13:10', 'upload/8395/prettt.jpg;', 'off', 'off', 'refusee', 'off', 'on');
